(122, 5, 'CCU-6', '<p>Hi [[firstname]],<br /><br />Congratulations - You may now apply to prestigious Colorado Christian<br />University. You are  also potentially able to apply for aid to help with schooling.&nbsp;</p>\r\n<p><span style="text-decoration: underline;"><strong>Act Now!&nbsp; Take advantage of this opportunity while you still can.<br /></strong></span><br />Aid is allocated on a case by case and first come basis and would not have to<br />be paid  back.&nbsp; Act now while this is still available to you.</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-03 12:06:01', '2016-11-11 10:44:51'),
(123, 5, 'CCU-7', '<p>Hi [[firstname]],<br /><br />Colorado Christian University is now accepting applicants and you may<br />meet the eligibility requirements for acceptance as well as aid.<br /><br /><span style="text-decoration: underline;"><strong>Act now to confirm your eligibility.</strong></span><br /><br />Aid is allocated on a case by basis and would not have to be paid back.&nbsp; Act<br />now  while this is still available to you.</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-03 12:06:49', '2016-11-11 10:45:04'),
(124, 5, 'CCU-8', '<p>Hi [[firstname]],<br /><br />We have some good news for you.&nbsp; You may apply to renowned  Colorado<br />Christian University.&nbsp;&nbsp; You may also apply for assistance with schooling.<br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity - Take Advantage of It Now!</strong></span><br /><br />Assistance is given out on a first come first serve basis and would not have<br />to be  repaid.&nbsp; Take advantage of this opportunity while you still can.</p>', NULL, '2016-10-03 12:07:56', '2016-11-11 10:44:32'),
(125, 6, 'CSU-1', '<p>Flexible, Affordable, ONLINE</p>\r\n<p><br />At Columbia Southern University,<br />we are here to guide you in the right direction to help you get the education you deserve.</p>\r\n<p>Not only do you get an education that could launch you into the next phase of your life,<br />but we also push you to become a confident professional today.</p>\r\n<p>With outstanding benefits we provide you the opportunity to take charge of your education<br />in a way that no other university offers.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Click here now to discover how CSU can work for you!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,<br />&nbsp;<br />Alex</p>', NULL, '2016-10-03 14:01:16', '2016-11-09 10:46:07'),
(126, 6, 'CSU-2', '<p>Hi [[firstname]],<br />&nbsp;<br />At CSU, we offer online degree programs, open enrollment,<br />affordable tuition rates, and a flexible learning style designed to<br />accommodate your life.</p>\r\n<p>Choose from associate, bachelor, master or certificate<br />programs in a variety of fields including business administration,<br />fire science, criminal justice administration, occupational safety<br />and health and more.</p>\r\n<p>Why not take a few minutes to discover how CSU can work for you?</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Click Here Now</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:02:59', '2016-11-09 10:46:20'),
(127, 6, 'CSU-3', '<p>Hi [[firstname]],<br />&nbsp;<br />At Columbia Southern University,<br />our degree programs encompass courses designed to provide foundations,<br />best practices and innovations in key areas to ensure the student learns<br />and engages with the academic lessons. Backed by CSU faculty who are<br />leaders in their fields, the degree programs offer rewarding and challenging<br />content to push students&rsquo; knowledge and skills.</p>\r\n<p><br />Why Choose CSU?<br />&nbsp;<br />- Affordable Tuition<br />- Various Financing Options<br />- Textbooks Provided<br />- Industry Relevant Curriculum<br />- Outstanding Student Support<br />- Math and Writing Assistance<br />- Career Services for Students and Alumni<br />- TA and VA Benefits</p>\r\n<p>Take a few minutes now to find out how CSU can work for you.</p>\r\n<p><br /><strong><span style="text-decoration: underline;">Click Here Now</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:04:21', '2016-11-09 10:46:32'),
(128, 7, 'LB-1', '<p>Hi [[firstname]],</p>\r\n<p>As someone who has shown interest previously in matters<br />of this nature this is something that will surely interest you.</p>\r\n<p>During the last allocation period we have helped connect<br />thousands people like yourself with financial aid and schools<br />that will accept funding of this nature.</p>\r\n<p>According to our records you may meet the requirements of<br />qualifying for aid for the purposes of obtaining a higher education.</p>\r\n<p>You may also be eligible to apply to attend prestigious University.<span style="text-decoration: underline;"><strong><br /><br />Please go here now to confirm your qualification.</strong></span><br /><br />This process is extremely simple and will only take<br />a few minutes of your time.</p>\r\n<p>Be sure to take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:06:36', '2016-11-09 10:48:30'),
(129, 7, 'LB-2', '<p>Hi [[firstname]],<br /><br />According to our records you may meet the<br />eligibility requirements of application to<br />prestigious Liberty University.<span style="text-decoration: underline;"><strong><br /><br />Please go here now to confirm your eligibility.</strong></span><br /><br />Federal aid may be available to you as well.</p>\r\n<p>Act now while this is still available to you.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:07:21', '2016-11-09 10:50:28'),
(130, 7, 'LB-3', '<p>Hi [[firstname]],<br /><br />According to our records you may meet the eligibility requirements<br />for application to prestigious Liberty University.<span style="text-decoration: underline;"><strong><br /><br />Please confirm your eligibility now by going here.</strong></span></p>\r\n<p>This will only take a few moments of your time.</p>\r\n<p>Funding to help pay for your schooling needs may also be available<br />to you.<br />Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best of luck,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:08:33', '2016-11-09 10:52:40'),
(131, 7, 'LB-4', '<p>Hi [[firstname]],<br /><br />As someone who has expressed interest previously in this<br />topic here is something that you will want to take note of</p>\r\n<p>During the last period of disbursements we assisted<br />thousands of people like yourself get approval for financial<br />aid while connecting them with institutions that are looking<br />for applicants like yourself.</p>\r\n<p>According to our files you could potentially meet the<br />requirements of qualifying for aid for the purposes of<br />returning to school.</p>\r\n<p>You may also be eligible to apply to go to prestigious<br />Liberty University.<span style="text-decoration: underline;"><br /><br /><strong>Please go here now to confirm your eligibility.</strong></span><br /><br />This process is very simple and will only take a few moments<br />of your time.</p>\r\n<p>Make sure to act on this while you still are able to.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:10:27', '2016-11-09 10:53:01'),
(132, 7, 'LB-5', '<p>Hi [[firstname]],<br /><br />According to our master file there is a strong potential of<br />you meeting the eligibility requirements for application to<br />renowned Liberty University.<span style="text-decoration: underline;"><strong><br /><br />Please go here now to confirm your qualification.</strong></span><br /><br />You may also potentially be eligible to receive federal aid.</p>\r\n<p>Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best of luck,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:11:12', '2016-11-09 10:53:32'),
(133, 7, 'LB-6', '<p>Hi [[firstname]],<br /><br />Our records indicate that there is the strong likelihood of you meeting<br />the eligibility requirements for application to prestigious Liberty University.<span style="text-decoration: underline;"><strong><br /><br />This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span><br /><br />You may also potentially be eligible to receive funding for your expenses.</p>\r\n<p>This eligibility period won&rsquo;t last long so act while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:11:58', '2016-11-09 10:54:03');

