(1, 1, 'EDU111A', '<p>Good afternoon [[FName]],<br /><br /><br />I hope you are enjoying your {{Dayofweek}}...Quick reminder...<br /><br /><br />You may be eligible to receive grant money for school.<br /><br /><br />The amount is up to $5,815*.<br /><br /><br />The best part of this is these grants do not have to be paid back.<br /><br /><br />It only takes a minute to learn more about this opportunity. &nbsp;<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>\r\n<p><br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br /><br /></p>', NULL, '2016-09-28 08:28:29', '2016-11-08 13:18:05'),
(2, 1, 'EDU111B', '<p>Hey {{Fname}}, I hope this message finds you in time.<br /><br /><br />I just wanted to let you know I\'ve got some great news for you.<br /><br /><br />Grant funding is available for college<br />and you may be eligible to receive some.<br /><br /><br />The amount you could receive is $5,815*.<br /><br /><br />You can use these funds for online courses to further your career and<br />help you earn more and enjoy life.<br /><br /><br />The best part is these grants don&rsquo;t have to be paid back.<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now to find out if you qualify</strong></span><br /><br /><br />It only takes a minute to find out if you qualify.<br /><br /><br />Thank you, <br /><br /><br /><br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br /><br /></p>', NULL, '2016-09-29 00:05:10', '2016-11-08 13:18:45'),
(3, 1, 'EDU111C', '<p>Hey {{Fname}},<br /><br /><br />Still thinking about going to college?<br /><br /><br />If you are undecided, that&rsquo;s okay. Just know that when you&rsquo;re ready, you may qualify for<br />up to $5,815 in grant funding for college (if you qualify &mdash; learn more about your eligibility<br />by reading this email).<br /><br /><br />Unlike loans, these grants are yours to keep forever. This means you will never be<br />asked to pay them back. <br /><br /><br />That sounds awesome, right?<br /><br /><br />Even if you&rsquo;re too busy, you should still consider finding out if you qualify for the grant<br />funds. The reason why is because you can use the $5,815 for online classes.<br /><br /><br />Finding schools and getting more information about this opportunity only takes a few<br />minutes, tops.<br /><br /><br />Just answer a few simple questions to get started.<br /><br /><br />Good luck!<br /><br /><br /><span style="text-decoration: underline;"><strong>Want to Learn More? Go Here Now</strong></span><br /><br /><br />Respectfully,<br />Alex<br /><br /><br /><em>P.S. If you are skeptical about this, I understand. </em><br /><br /><br /><em>P.P.S. Once you&rsquo;ve confirmed the fact $5,815 is available for new and returning </em><em>qualified<br />students, visit the following link to get matched with schools.</em><br /><br /><br /><em>Go here to get more information (it&rsquo;s free)</em><br /><br /></p>', NULL, '2016-09-29 00:07:08', '2016-11-08 13:26:40'),
(4, 1, 'EDU111D', '<p>Hey {{Fname}}.<br /><br />Did you know that you may be entitled to up to $5,815* in funding for college?<br /><br />Most people are unaware of how much money is being provided to Americans who<br />cannot afford an education.<br /><br />It only takes a few minutes to find schools and learn more about this opportunity. <br /><br />One of the best parts about this is you never have to pay the money back.<br /><br />Pretty awesome, right?<br /><br />You can even use the grant money for online classes, so you can get an education on<br />your own schedule. <br /><br />Like I said, it just takes a minute to get started.<br /><br />Have a great day.<br /><br />And an even greater week!<br /><br /><br /><span style="text-decoration: underline;"><strong>Want to Learn More? Go Here Now</strong></span><br /><br /><br />Respectfully,<br />Alex<br /><br /><br /><em>P.S. If you are skeptical about this, I understand. </em><br /><br /><em>P.P.S. Once you&rsquo;ve confirmed the fact $5,815 is available for new and returning qualified</em><br /><em>students, visit the following link to get matched with schools.</em><br /><br /><em>Go here to get more information (it&rsquo;s free)</em><br /><br /></p>', NULL, '2016-09-29 00:07:44', '2016-11-08 13:27:59'),
(5, 1, 'EDU111E', '<p>Hey {{Fname}},<br /><br />Right now up to $5,815 a year is available to new and returning qualified students.<br /><br />Learning more about this great opportunity is simple. We&rsquo;ve outline how to get it in 3<br />steps.<br /><br />Visit the URL at the end of this email after reading these steps<br />Answer the simple questions it asks you (it will take you 2 minutes, tops)<br />Speak to an enrollment counselor about the financial aid you may qualify for<br /><br />One of the things people like most about this is you never have to pay the money back.<br />Grant money is yours to keep, forever.<br /><br />Another thing people like about this is you can use the money for online classes. This<br />means you can get an education, without regularly driving to and from campus.<br /><br />Ready for the URL now?<br /><br />Here you go...<br /><br /><br /><span style="text-decoration: underline;"><strong>Want to Learn More? Go Here Now</strong></span><br /><br /><br />Respectfully,<br />Ash Lynn<br /><br /><br /><em>P.S. If you are skeptical about this, I understand. </em><br /><br /><em>P.P.S. Once you&rsquo;ve confirmed the fact $5,815 is available for new and returning qualified</em><br /><em>students, visit the following link to get matched with schools.</em><br /><br /><em>Go here to get more information (it&rsquo;s free)</em><br /><br /></p>', NULL, '2016-09-29 00:08:19', '2016-11-08 13:30:49'),
(6, 1, 'EDU111F', '<p>Hey {{Fname}},<br /><br />There&rsquo;s a popular saying that goes like this.<br /><br />The more you learn, the more you _____.<br /><br />Can you guess the answer?<br /><br />We&rsquo;ll help you out, if you&rsquo;re stumped.<br /><br />Just give this a try on your own, first.<br /><br />(Scroll down for answer.)<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br /><br />Okay. <br /><br />Ready for the answer?<br /><br />Here you go.<br /><br />The more you learn, the more you earn.<br /><br />It&rsquo;s true. <br /><br />The more you learn, the more money you earn. The problem is people these days are<br />struggling with paying for their education. Perhaps you are one of these people who&rsquo;re<br />struggling to make ends meet.<br /><br />If you are, then I&rsquo;ve got great news for you!<br /><br />Up to $5,815* in college funding is available to new and returning students who qualify<br />for help.<br /><br />Learning more about this great opportunity takes about two minutes, tops. I&rsquo;ve included<br />where you can get more information at the end of this email.<br /><br />One of the biggest benefits of this grant money is you will never have to pay it back.<br /><br />Another benefit of this grant money is you can use it for online classes. Which is great<br />for you if you have a busy schedule.<br /><br />Like I said, it only takes a few minutes to find schools and get more information about<br />financial aid.<br /><br />Here is the link I promised you: <br /><br /><br /><span style="text-decoration: underline;"><strong>Want to Learn More? Go Here Now</strong></span><br /><br /><br />Respectfully,<br />Alex<br /><br /><br /><em>P.S. If you are skeptical about this, I understand. </em><br /><br /><em>P.P.S. Once you&rsquo;ve confirmed the fact $5,815 is available for new and returning qualified</em><br /><em>students, visit the following link to get matched with schools.</em><br /><br /><em>Go here to get more information (it&rsquo;s free)</em></p>', NULL, '2016-09-29 00:08:50', '2016-11-08 13:33:05'),
(7, 1, 'EDU111G', '<p>Hey {{Fname}},<br /><br />Hope you&rsquo;re having an amazing week, so far.<br /><br />Just wanted to remind about something you might&rsquo;ve forgotten.<br /><br />It&rsquo;s about how up to $5,815* a year is available for new and returning students who<br />qualify.<br /><br />If you&rsquo;re thinking about gaining new skills so you can increase your earning potential,<br />surely this grant money can help.<br /><br />I&rsquo;ll shoot you the link to see if you qualify at the bottom of this email. I first want to clarify<br />a few things.<br /><br />You will never have to pay it back. <br />You can use the $5,815 for online classes. This is a great benefit for working parents or<br />busy people.<br /><br />Not a bad deal, right?<br /><br />Haha... of course it&rsquo;s not. <br /><br />Get started now by speaking to an enrollment counselor and learning more about your<br />financial aid eligibility.<br /><br />Good luck!<br /><br /><br /><span style="text-decoration: underline;"><strong>Want to Learn More? Go Here Now</strong></span><br /><br /><br />Respectfully,<br />Alex<br /><br /><br /><em>P.S. If you are skeptical about this, I understand. </em><br /><br /><em>P.P.S. Once you&rsquo;ve confirmed the fact $5,815 is available for new and returning qualified</em><br /><em>students, visit the following link to get matched with schools.</em><br /><br /><em>Go here to get more information (it&rsquo;s free)</em></p>', NULL, '2016-09-29 00:09:26', '2016-11-08 13:34:37'),
(8, 1, 'EDU11A', '<p>Good morning {FNAME},<br /><br />Have you heard about this great news yet?<br /><br />Obama recently initiated TWO new changes aimed at helping new and<br />returning students graduate a college of their choice, easier and faster.<br /><br /><strong>As of January 2016...</strong><br /><br />You could receive an extra $300 for completing a certain amount of<br />credits per semester <br />You could access an additional $1,915 in financial support year-round,<br />sent directly to you via check or direct deposit (even during the summer<br />time)<br />All funding is to be used with qualified schools<br /><br /><strong>These two new changes are in addition to the already-existing</strong><br /><strong>$5,815* in available now to qualifying students.</strong><br /><br />Great news, right?<br /><br />Remember...<em> none of these funds have to be paid back.</em><br /><br />In only takes about a minute to see if you&rsquo;re eligible:<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span><br /><br /></p>', NULL, '2016-09-29 00:10:16', '2016-11-08 13:48:31'),
(9, 1, 'EDU11B', '<p>Good morning {FirstNAME},<br /><br />Hope you&rsquo;re having an amazing day.<br /><br />Quick question...<br /><br />Would you be interested in receiving $5,815 via check or direct deposit, per<br />semester?<br /><br />New&nbsp; assistance now allows people who are eligible to receive fr--ee funds<br />for school.<br /><br />Even better is the fact they do not require you to pay back!<br /><br />This is basically &ldquo;fr--ee funds&rdquo; for school.<br /><br />Awesome, right?<br /><br />It only takes a minute to see if you are eligible.&nbsp; Why not see what schools<br />you can apply to?<br /><br /><br /><span style="text-decoration: underline;"><strong>A Direct Deposit Could Be Yours&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-29 00:10:45', '2016-11-08 14:01:46'),
(10, 1, 'EDU11C', '<p>Good morning {FNAME}<br /><br />Hope you have a great day today and an even greater week.<br /><br /><strong>Just a quick reminder...</strong><br /><br />You are still eligible to apply to receive money for school.<br /><br /><strong>The amount available is $5,815*</strong> <br /><br />And... if you&rsquo;re eligible (most people are), you can be directly deposited into your bank<br />account or receive the full amount on a personalized check.<br /><br />Because these are granted funds, you do not have to pay the money back.<br /><br />It is easy and quick to find out if you&rsquo;re eligible.&nbsp;&nbsp; Why not find out what schools you can<br />potentially attend with aid to?<br /><br /><span style="text-decoration: underline;"><strong>Stop Being a Statistic&nbsp; Go Here Now!</strong></span><br /><br /><br />Sincerely,<br /><br />(name)<br /><br /></p>', NULL, '2016-09-29 00:11:19', '2016-11-08 14:02:43'),
(11, 1, 'EDU11D', '<p>Hello {FNAME}!<br /><br />Today you can play this fun game...<br /><br />Try and guess what these 3 things have in common:<br /><br />(This game is not hard...)<br /><br />Here are your choices:<br /><br />Getting an awarded amount of $5,815...<br />Finding out if you&rsquo;re qualified that takes minutes...<br />Keeping every cent of your funds (you never have to pay it back)...<br /><br />Take your best guess, good luck.<br /><br />(Or continue to read for the answer...)<br /><br />.<br /><br />.<br /><br />.<br /><br /><br />ANSWER: <em>&ldquo;Fr----ee funds&rdquo; for college for you and your family!</em><br /><br />Interested in receiving (and never paying back) up to $5,815* for school that you never<br />have to pay back?<br /><br />Since finding out if you are eligible can be done in about a minute or two why not take a<br />few minutes to find out what schools you can attend?<br /><br /><br /><span style="text-decoration: underline;"><strong>Find Out In Mere Minutes</strong></span></p>', NULL, '2016-09-29 00:11:51', '2016-11-08 14:03:47'),
(12, 1, 'EDU11E', '<p>Good morning {FNAME},<br /><br />Isn&rsquo;t today a wonderful day to be alive?<br /><br />Steve, an email subscribers who used to be in prison, wanted to share his story with you:<br /><br /><em>"I did 5 years in prison&hellip;</em><br /><br /><em>Even though my income from the previous tax year was $0, I was still able to qualify for<br />government help that fully funded my degree plan. </em><br /><br /><em>My criminal background didn&rsquo;t matter; I was able to get my associates degree in welding<br />technology. </em><br /><br /><em>And... then a bachelors to become a welding engineer. </em><br /><br /><em>I&rsquo;m now working full time and happily supporting my family thanks to help for returning<br />students..."</em><br /><br />Wow...<br /><br />What an amazing story, right? <br /><br />One of the best parts about Steve&rsquo;s story is he will never have to pay back the free funds!<br /><br />Steve&rsquo;s message is a gift that shows you how education is now available to anyone.<br /><br />Most people (even former inmates) qualify for up to $5,815!<br /><br />It only takes a check out how much you are eligible to receive this money that is sent to you<br />in a check or direct deposit.&nbsp;&nbsp; Find out now what schooling opportunities are potentially<br />available to you.<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 00:12:22', '2016-11-08 14:05:55'),
(13, 1, 'EDU11F', '<p>Good morning {FNAME},<br /><br />I just thought of something...<br /><br />Did you know right now you can receive up to $5,815* while sitting at home on your couch?<br /><br />It&rsquo;s true.<br /><br /><strong>Here&rsquo;s how it works.</strong><br /><br />Click the link at the bottom of this email once you&rsquo;re done reading these steps<br />Complete the quick application (it takes 1-2 minutes)<br />Register for an ONLINE class about the subject of your choice<br /><br />Pretty cool, right?<br /><br /><em>The great thing about this is you&rsquo;ll never have to pay back the funds!</em><br /><br />Once the check in your name is in your account or you receive your direct deposit, the<br />funds are yours forever.&nbsp; Why not take mere moments to find out what schools you are<br />eligible for?<br /><br />Now here is the link I told you about for getting started:<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span><br /><br /><br /><br />Sincerely,<br /><br />Alex<br /><br /></p>', NULL, '2016-09-29 00:12:53', '2016-11-08 14:07:11'),
(14, 1, 'EDU11G', '<p>Hi {FNAME},<br /><br />What are your thoughts on school?<br /><br /><strong>Let us look at the facts...</strong><br /><br /><em>A recent study revealed high school graduates only earn about 62% of what those with<br />four-year degrees earn.</em><br /><br />In other words... <br /><br />Going to college is the difference between making $62,000 and $100,000.<br /><br /><strong>Imagine what you could do with an extra $38,000 a year?</strong><br /><br />You could buy a new car.<br /><br />Afford a nicer house.<br /><br />And be way less stressed.<br /><br /><strong>Sounds wonderful right?</strong><br /><br />It gets better.<br /><br />Right now if eligible... <em>you can receive up to $5,815* per semester to make your college</em><br /><em>dreams happen!</em><br /><br />What is even more amazing is you will never have to pay the money back.<br /><br />Once it is sent to you in a check or direct deposit the money is yours to keep forever.<br /><br />Since checking out if you are eligible only takes a minute why not spend a few moments to<br />find out what schools you can potentially attend?&nbsp; You never know until you try and you<br />might be pleasantly surprised.<br /><br /><br /><span style="text-decoration: underline;"><strong>Confirm Your Eligibility Now!</strong></span></p>', NULL, '2016-09-29 00:13:27', '2016-11-08 14:10:08'),
(15, 1, 'EDU11H', '<p>{FNAME},<br /><br />Phew.<br /><br />I hadn&rsquo;t heard from you and was wondering what was up.&nbsp;&nbsp; Hope everything is amazing with<br />you!<br /><br />Now for some good news...<br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct</strong><br /><strong>deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are potentially<br />eligible for.<br /><br />Good Luck!<br /><br /><br /><span style="text-decoration: underline;"><strong>Time is Limited&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-29 00:13:53', '2016-11-08 14:11:55'),
(16, 1, 'EDU11I', '<p>Ladies...<br /><br />I just read something disturbing and weird.<br /><br />It was about this new trend where women add fur to their fingernail polish.<br /><br /><strong>Anyway...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct</strong><br /><strong>deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out now what schools you are eligible for.<br /><br /><br /><span style="text-decoration: underline;"><strong>Good News Could be Yours! (Go Here Now)!</strong></span></p>', NULL, '2016-09-29 00:14:31', '2016-11-08 14:13:20'),
(17, 1, 'EDU11J', '<p>My cat died today.<br /><br />Sorry to tell you that.<br /><br />It has just been hard for and I needed to tell someone.<br /><br />Have you ever lost someone close to you?<br /><br /><strong>Anyway...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct<br />deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible for.<br /><br /><br /><span style="text-decoration: underline;"><strong>Click Here Now!</strong></span></p>', NULL, '2016-09-29 00:15:05', '2016-11-08 14:14:30'),
(18, 1, 'EDU11K', '<p>Crazy news...<br /><br />Was at Target today and I saw the strangest thing happen.<br /><br />A woman got arrested for stealing cookie dough.<br /><br />She, um, tried to hide it in place that is... off limits.<br /><br />But what happened was she got caught because the can of cookie dough exploded from being<br />there too long.<br /><br /><strong>Anyway...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct<br />deposited.</strong><br /><br />The best part of this is<em> none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible for.<br /><br /><br /><span style="text-decoration: underline;"><strong>A Direct Deposit Could Be Yours&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-29 00:15:35', '2016-11-08 14:15:42'),
(19, 1, 'EDU11L', '<p>This email is for uncommitted men only...<br /><br />You know what they say about college girls, right?<br /><br />That no matter how old you are, college girls always stay the same age.<br /><br /><strong>I feel weird telling you this...</strong><br /><br />But I know a lot of men who do this one trick to meet younger women.<br /><br />What they do is apply for grants and attend community college for free.<br /><br />Then... because of their age, they end up dating a lot of younger women. <br /><br /><strong>Girls LOVE older men...</strong> <br /><br />So if you are a man age 24+...<br /><br />I am here to remind you that you are eligible to apply to receive grant money for<br />school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it<br />direct deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible<br />for.<br /><br />Good Luck! <br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 00:16:07', '2016-11-08 14:16:56'),
(20, 1, 'EDU11M', '<p>Hello.<br /><br />Do you have a favorite type of pie?<br /><br />My favorite pie is peach. <br /><br /><strong>Mmm...</strong><br /><br />Warm peach pie with French vanilla ice cream.<br /><br />Amazingly delicious!<br /><br />What is your favorite?<br /><br />(Or maybe you are a cake person?)<br /><br /><strong>By the way...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct<br />deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible for.<br /><br /><br /><span style="text-decoration: underline;"><strong>Act Now!</strong></span></p>', NULL, '2016-09-28 17:25:57', '2016-11-08 14:18:31'),
(21, 1, 'EDU11N', '<p>Hello,<br /><br />Did you see the recent thing shared by Jeb Bush?<br /><br />He posted a picture with a cold .45 with the title &ldquo;America.&rdquo;<br /><br />What are your thoughts on that?<br /><br /><strong>Quick reminder...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct<br />deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible for.<br /><br />Good Luck! <br /><br /><br /><span style="text-decoration: underline;"><strong>With Nothing to Lose Why not Take 2 Minutes to See If You Qualify</strong></span></p>', NULL, '2016-09-28 17:27:26', '2016-11-08 14:19:46'),
(22, 1, 'EDU11O', '<p>Jeez...<br /><br />What&rsquo;s going on right now with Kayne West is so outrageous. <br /><br />What are your thoughts about his approach to being a celebrity?<br /><br /><strong>Quick reminder...</strong><br /><br />I am here to remind you that you are eligible to apply to receive grant money for school.<br /><br /><strong>The amount is $5,815* and it is given to you in a check or you can have it direct<br />deposited.</strong><br /><br />The best part of this is <em>none of the funds have to be paid back.</em><br /><br />It only takes about a minute to check it out and find out what schools you are eligible for.<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-28 17:28:36', '2016-11-08 14:21:35'),
(23, 1, 'EDU11P', '<p>{fname},<br /><br />How do you tell if a politician is lying to you?<br /><br />Answer: they&rsquo;re moving their lips.<br /><br />Here&rsquo;s how to defend yourself from the lies.<br /><br />Get educated.<br /><br />Sounds difficult?<br /><br />It&rsquo;s not, really. <br /><br />In fact, it&rsquo;s never been easier (and cheaper) to upgrade your intelligence than it is today. <br /><br />Here&rsquo;s why...<br /><br />Right now funding of up to $5,815* is being given to people who&rsquo;re interested in getting a<br />college education. <br /><br />The money being given away is directly deposited into a checking account of your choice<br />and you never have to pay it back. This means you can spend the funds however you want<br />&mdash; without paying any interest.<br /><br />You can use these funds for online classes if you choose. Which is great if you don&rsquo;t have<br />the time to drive back and forth to and from campus.<br /><br /><br /><span style="text-decoration: underline;"><strong>Time is Limited&nbsp; Go Here Now!</strong></span><br /><br /><br /><br />Once you visit the page, you&rsquo;ll be taken to a quick verification process. <br /><br />Why not take a few minutes to find out what schools you are eligible for?<br /><br /><br />Respectfully,<br /><br />Alex</p>', NULL, '2016-09-28 17:30:16', '2016-11-08 14:23:06'),
(24, 1, 'EDU11Q', '<p>Hey {fname},<br /><br />Here&rsquo;s the thing... <br /><br />It takes more than a vote to make something great.<br /><br />Instead of relying on someone else, do this: get yourself a college level education. <br /><br />You have no excuse not to, especially when up to $5,815* is being given away to qualified<br />people who want to go to college.<br /><br />You&rsquo;ve heard about this before, right?<br /><br />If not, here&rsquo;s how it works...<br /><br />Once you complete a quick, fr--ee verification process if qualified you can reserve your<br />right to get a check directly deposited into your bank account or mailed to you directly. <br /><br />Because it&rsquo;s a Grant, you will not be asked to pay it back.<br /><br />The money would&nbsp; be yours to keep forever.<br /><br />You can even use the money for online classes, which is great if you&rsquo;re too busy to drive to<br />a campus.<br /><br /><br /><span style="text-decoration: underline;"><strong>A Direct Deposit Could Be Yours&nbsp; Go Here Now!</strong></span><br /><br /><br />Why not take a few moments to find out what schools you can potentially attend?<br /><br />Today you have the chance to make life great.<br /><br />Don&rsquo;t rely on others.<br /><br />Don&rsquo;t wait until the next election.<br /><br />Begin the change today!<br /><br /><br /><br />Respectfully,<br /><br />Alex</p>', NULL, '2016-09-28 17:31:43', '2016-11-08 14:24:50'),
(25, 1, 'EDU11R', '<p>Hello,<br /><br />So it&rsquo;s no secret Bernie Sanders wants to &ldquo;rebalance&rdquo; America&rsquo;s wealth.<br /><br />One of his ways of getting votes is telling people he&rsquo;ll make college fr--ee. <br /><br />People everywhere are talking about the idea of fr--ee college, but what most people don&rsquo;t<br />know is right now there&rsquo;s already a way to get a free education. <br /><br />Oh, you didn&rsquo;t know?<br /><br />Here&rsquo;s how it works. <br /><br /><span style="text-decoration: underline;"><strong>First, go here to see if you&rsquo;re eligible to receive up to $5,815* to attend school</strong></span><br /><br />If and when you&rsquo;ve been approved, you&rsquo;ll receive a direct payment into a checking account<br />of your choice or you can have a check for up to $5,815 mailed to you.<br /><br />You&rsquo;ll be able to use this money for your education as you wish. Because it&rsquo;s a grant, you<br />never have to pay it back.<br /><br />The money will be yours to keep forever.<br /><br />You can even use the funds for online classes, so you can continue to spend time at home<br />while getting your education paid for.<br /><br />Most people don&rsquo;t know about this, but those who do will benefit. <br /><br />You don&rsquo;t have to wait until next election to get a fr--ee college education.&nbsp; Why don&rsquo;t you<br />take a few moments to find out what schooling opportunities you are eligible for?<br /><br /><br />Respectfully,<br /><br />Alex</p>', NULL, '2016-09-28 17:33:14', '2016-11-08 14:26:03'),
(26, 1, 'EDU11S', '<p>Hello,<br /><br />If it were up to Hillary Clinton, she&rsquo;d rather you not read this message.<br /><br />The reason why is because she is like most people in her position, she wants you to pay an<br />arm and a leg for things that benefit you and your family.<br /><br />But here&rsquo;s the thing, there are ways around paying your entire paycheck for making your life<br />better. <br /><br />For example, right now if you wanted to go to college you can get up to $5,815* in aid.<br /><br />Did you know about that yet?<br /><br />The way it works is simple.<br /><br /><br /><span style="text-decoration: underline;"><strong>Click Here Now!</strong></span><br /><br /><br />Once you do, you can get a check directly deposited for up to $5,815 into a banking account<br />of your choice or sent to you directly.<br /><br />This is not a loan, by the way.<br /><br />You will never be asked to pay it back and the $5,815 in funds are yours to keep forever.<br /><br />You can even use the funds for online classes, so you can attend college online using aid funds.<br /><br />Don&rsquo;t pay for things that are fr--ee.<br /><br />Stop letting other people misinform you about things that are not true. &nbsp;<br /><br />Take a stand.&nbsp; Why not take a few moments to find out what schools you are eligible to attend?<br /><br />Make the change. <br /><br />And get an education that benefits your life forever!<br /><br /><br />Respectfully,<br /><br />Alex</p>', NULL, '2016-09-28 17:35:25', '2016-11-08 14:35:23'),
(27, 1, 'EDU11T', '<p>{fname},<br /><br />The reason why people today are rich isn&rsquo;t just because of money.<br /><br />There are specific things rich people do to get richer than everyone else.<br /><br />One of these things is to take advantage of certain legal &ldquo;loopholes&rdquo; that come along every<br />now and then. <br /><br />An example of a &ldquo;loophole&rdquo; that is presented to you right now is getting $5,815 toward your<br />education.<br /><br />I mean, seriously, why would you pay for education when you can get someone else to pay<br />it for you?<br /><br />There is no catch. <br /><br />The money comes in the form of a Grant, so you never once have to pay it back.<br /><br />All you have to do is say, &ldquo;I&rsquo;m interested in going to school&rdquo; and if you are approved they&rsquo;ll<br />directly deposit the check into a banking account of your choice or send it to your mailbox.<br /><br />It&rsquo;s that simple.&nbsp; Why not take a few minutes to find out what schools you are eligible to attend?<br /><br /><span style="text-decoration: underline;"><strong>Find Out In Mere Minutes!</strong></span><br /><br />You can even apply the funds toward online classes, so you can go to college from the comfort<br />of anywhere you want.<br /><br />Knowledge is power.<br /><br />And with this knowledge of how to get a fr--ee education, you can increase your income and<br />improve your life by adding a degree to your resume.<br /><br />Good luck!<br /><br /><br />Respectfully,<br /><br />Alex</p>', NULL, '2016-09-28 17:36:50', '2016-11-08 14:36:24'),
(28, 1, 'EDU1A', '<p>Hey {{Fname}}, I hope this message finds you in time.<br /><br />I just wanted to let you know I\'ve got some great news for you.<br /><br />Money is being given out in {#FIELD:STATE||your state#} for college<br />and you may be eligible to receive some.<br /><br />The amount you could receive is $5,815* and it\'s given to you in a check<br />or you can have it direct deposited.<br /><br />You can use these funds for online courses to further your career and<br />help you earn more and enjoy life.<br /><br />The best part is none of the funds have to be re-paid back.<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now to Find Out if You Qualify</strong> </span><br /><br /><br />It only takes a minute to find out if you qualify.&nbsp; Why not find out now what schools you are<br />potentially eligible to attend?<br /><br /><br />Thank you, <br /><br />Alex</p>', '2', '2016-09-28 17:38:40', '2016-11-08 14:37:56'),
(29, 1, 'EDU1B', '<p>Good afternoon [[FName]]<br /><br />I hope you are enjoying your day.....Quick reminder...<br /><br />You are eligible to apply to receive grant money for school.<br /><br />The amount is $5,815* and it\'s given to you in a check or you can have it direct<br />deposited.<br /><br />The best part of this is <em><span style="text-decoration: underline;">none of the funds have to be paid back.</span></em><br /><br />It only takes about a minute to check it out.&nbsp; Why not take a few minutes to find<br />out what schools you are eligible to attend with help?<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', '2', '2016-09-28 17:40:30', '2016-11-08 14:38:45'),
(30, 1, 'EDU1C', '<p>Hi [[fname]],<br /><br /><br />If you haven\'t filled out your forms for you back to<br />school grant, then you may want to do so today&hellip;<br />The window for acceptance is closing.<br /><br />You may miss out on up to $5,815 that could be<br />deposited into your bank account.<br /><br /><span style="text-decoration: underline;"><strong>Find out your grant amount</strong></span><br /><br />June just started and tons of people just like you are<br />flocking to get their grant money for school, before the deadline.<br /><br />Don\'t let this pass you by! Take the first step and fill out the forms<br />to find out how much you could qualify for.<br /><br /><span style="text-decoration: underline;"><strong>Click here to see how much you could receive</strong></span><br /><br />Already this month 765 of our members have been approved for<br />some type of financial aid, and so could you.<br /><br /><span style="text-decoration: underline;"><strong>Apply for your grant today!</strong></span><br /><br />This could be the one step that starts your year off right,<br />and gets you into a better career.&nbsp; Why not take a few minutes to find out what schools<br />you can potentially attend?<br /><br />Hope this helps!<br /><br /><br />Sincerely,<br /><br />Alex</p>', '2', '2016-09-28 17:41:56', '2016-11-08 14:41:18'),
(31, 1, 'EDU1D', '<p>[[FNAME]],<br /><br />Please read carefully, this is legitimate information.<br /><br />Did you know the government will actually pay you<br />5,815 in grant funds just to go back to school.<br /><br />It\'s simple to qualify and most people do actually<br />qualify.<br /><br /><br /><span style="text-decoration: underline;"><strong>Confirm Your Eligibility Now!</strong></span><br /><br /><br />It takes only a minute to check.<br /><br />This is not a loan and funds do not need to be<br />repaid.<br /><br /><br />Sincerely,<br /><br />Alex</p>', '2', '2016-09-28 17:42:41', '2016-11-08 14:41:58'),
(32, 1, 'EDU1E', '<p>Hey {{Fname}}, I hope your day is going really well.<br /><br />I am excited to let you know I\'ve got some awesome news for you.<br /><br />There is money being allocated in {#FIELD:STATE||your state#} for college<br />and you may be eligible to receive some.<br /><br />You could receive $5,815* which is either given to you in a check<br />or by direct deposit.<br /><br />You are able to use these funds for online courses to further your career and potentially<br />help you earn more and enjoy life.<br /><br />The really nice part is that none of the funds have to be re-paid.<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now to find out if you qualify</strong></span><br /><br /><br />It only takes a minute to find out if you qualify.<br /><br /><br />Sincerely, <br /><br />Alex</p>', '2', '2016-09-28 17:43:48', '2016-11-08 14:49:46'),
(33, 1, 'EDU1111A', '<p>Hi there!<br /><br />Hope your day is going awesome!&nbsp; Wanted to give you a quick<br />reminder about some important information.<br /><br />According to our database you are eligible to apply to get grant funds<br />for school.<br /><br />The funding amount would be $5,815* and it&rsquo;s paid via check or direct<br />deposit.<br /><br />What is great about this is that <em><span style="text-decoration: underline;">the funds do not have to be repaid</span></em><br /><br />In mere minutes you can find out if you are eligible and what schools<br />that you can potentially attend.&nbsp; Why not take a sec to find out more?<br /><br /><br /><span style="text-decoration: underline;"><strong>Good News Could be Yours! (Go Here Now)!</strong></span></p>', NULL, '2016-09-28 17:45:18', '2016-11-08 14:50:54'),
(34, 1, 'EDU1111B', '<p>Hey {{Fname}}, hope that your day is going great and that you get this in time.<br /><br />Let&rsquo;s see if we can brighten your day.<br /><br />Funds are being allocated in {#FIELD:STATE||your state#} for schooling<br />purposes and you may be eligible to get yours<br /><br />The funding that you could get is $5,815* and it\'s paid either by direct deposit<br />or check directly to you.<br /><br />Funding is to be used for either online or in class courses to further your career<br />and help improve your career prospects.<br /><br />What is really nice about this is that none of the funds need to be repaid.<br /><br /><br /><span style="text-decoration: underline;"><strong>With Nothing to Lose Why not Take 2 Minutes to See If You Qualify</strong></span><br /><br /><br />It only takes a few minutes to find out what schools you are potentially eligible<br />go to.&nbsp; Good news could be right around the corner.<br /><br /><br />Sincerely,<br /><br />Alex</p>', NULL, '2016-09-28 17:46:38', '2016-11-08 15:01:38'),
(35, 1, 'EDU2D-A', '<p>Hey, [[FName]].<br /><br />Isn&rsquo;t today amazing?<br /><br />If you don&rsquo;t think so, then here is great news that will change your mind:<br /><br />You are now eligible to apply to receive grant money.<br /><br />The amount you&rsquo;d get if approved? <br /><br />$5,815*!<br /><br />These funds will come in the form of a check or a direct deposit, so you<br />can use it on whatever you&rsquo;d like.<br /><br />Can this news get better?<br /><br />Here&rsquo;s why... <em><span style="text-decoration: underline;">you will never be asked to pay the money back!</span></em><br /><br />See, I told you today is amazing.<br /><br />Don&rsquo;t miss this opportunity (it may be gone tomorrow). Act now, because<br />it only takes a few minutes to get started and find out what schools you<br />are potentially eligible to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Act Now!</strong></span></p>', NULL, '2016-09-28 17:53:44', '2016-11-08 15:05:02'),
(36, 1, 'EDU2D-B', '<p>Hi, [[FName]].<br /><br />Today will be glorious!<br /><br />Here&rsquo;s why:<br /><br />You are now eligible to apply to receive grant money.<br /><br />The amount you&rsquo;d get if approved is (wait for it...) $5,815*!<br /><br />ALL of these funds come in the form of a check or direct deposit, so<br />you can use your approved grant money wherever you&rsquo;d like.<br /><br />Here&rsquo;s how your day can become even MORE glorious... <em><span style="text-decoration: underline;">you will never</span></em><br /><em><span style="text-decoration: underline;">be asked to pay the money back!</span></em><br /><br />You can thank me later. Right now you need act now, so you don&rsquo;t miss<br />out on this opportunity. <br /><br />It only takes a few minutes to get started and find out what schools you<br />are potentially eligible to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Good News Could be Yours! (Go Here Now)!</strong></span></p>', NULL, '2016-09-28 17:55:24', '2016-11-08 15:06:02'),
(37, 1, 'EDU2D-C', '<p>Hi [[FName]],<br /><br />I have good news and... bad news.<br /><br />The bad news is my favorite sports team lost the other night.<br /><br />Now here&rsquo;s the good news: <br /><br />Right now you are now eligible to apply to receive a LARGE amount of<br />grant money.<br /><br />How much exactly would you get (if approved)? <br /><br />$5,815*!<br /><br />Yep. All $5,815* can be yours in the form of a check or direct deposit,<br />which means you can use your approved grant money on anything<br />you&rsquo;d like.<br /><br />The best part is... <em><span style="text-decoration: underline;">you will never be asked to pay the money back!</span></em><br /><br />Maybe my favorite sports team will win tomorrow. But who cares about<br />that, because right now you can win... TODAY!<br /><br />It only takes a few minutes to get started and discover what schools<br />you are potentially eligible to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Click Here Now - Time is Limited!</strong></span></p>', NULL, '2016-09-28 17:59:05', '2016-11-08 15:31:51'),
(38, 1, 'EDU2D-D', '<p>Hi, [[FName]].<br /><br />Guess what?<br /><br />I have the most amazing update for you!<br /><br />Right now you are eligible to apply to receive a LARGE amount of<br />grant money.<br /><br />The amount you&rsquo;d get (if approved) is... $5,815*!<br /><br />It will be sent to you in the form of a check or direct deposit, so you<br />can use your funds wherever you&rsquo;d like (a steak dinner, perhaps?)<br /><br />This update about funds is even more amazing because... <em><span style="text-decoration: underline;">you will</span></em><br /><em><span style="text-decoration: underline;">never be asked to pay the money back!</span></em><br /><br />Go see if you&rsquo;re eligible now, before this program goes away forever. It<br />only takes a few minutes to get started!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-28 18:02:12', '2016-11-08 15:32:53'),
(39, 1, 'EDU2D-E', '<p>Hi, [[FName]].<br /><br /><br />Don&rsquo;t let this opportunity pass you by...<br /><br />This is important (if you care about your future).<br /><br />You are now eligible to apply to receive a $5,815* in grant money.<br /><br />This grant money will be sent as a check or a direct deposit (read: not<br />a voucher), so you use the funds just like cash.<br /><br />Because it&rsquo;s grant money... <em><span style="text-decoration: underline;">you will never be asked to pay the money</span></em><br /><em><span style="text-decoration: underline;">back!</span></em><br /><br />$5,815* can be yours, but who knows what&rsquo;ll happen next election.<br />The grant money program may go away at any time!<br /><br />Go here and start before it goes away &mdash; it only takes a few minutes!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-28 18:05:05', '2016-11-08 15:36:26'),
(40, 1, ' EDU2D-F', '<p>Hi, [[FName]]<br /><br />What if you could get $5,815* <br /><br />...without ever being asked to pay it back?<br /><br />I&rsquo;m sure you&rsquo;d agree that would be amazing.<br /><br />Here&rsquo;s the good news!<br /><br />You are actually eligible to apply to receive a $5,815* in grant money<br />today, and get a check or a direct deposit in weeks.<br /><br />It only takes a few minutes to get started.<br /><br />The grant money program may go away at any time. Don&rsquo;t miss out on<br />this opportunity!<br /><br /><br /><span style="text-decoration: underline;"><strong>ACT NOW!</strong></span></p>', NULL, '2016-09-28 18:06:07', '2016-11-08 15:37:09'),
(41, 1, 'EDU2D-GJ', '<p>Hi, [[FName]].<br /><br />What a great day today!<br /><br />If for whatever reason your day isn&rsquo;t great perhaps here is some news<br />that will help with your day.<br /><br />As of this morning you are eligible to apply to receive grant funds.<br /><br />The amount of funds you could potentially receive? <br /><br />$5,815*!<br /><br />This money would come in the form of a check or a direct deposit, so<br />you can use them immediately..&nbsp; The funds are to be used for schooling.<br /><br />Is your day better now?<br /><br />It should be!... the great part is that <em><span style="text-decoration: underline;">you will never be asked to re-pay the</span></em><br /><em><span style="text-decoration: underline;">money!</span></em><br /><br />See, I told you today is great.<br /><br />Don&rsquo;t miss this opportunity (it may be gone tomorrow). Act now,<br />because it only takes a few minutes to get started and find out what<br />schools you might be eligible to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Apply In Mere Minutes Now</strong></span></p>', NULL, '2016-09-28 18:07:34', '2016-11-08 15:38:43'),
(42, 1, 'EDU2D-HJ', '<p>Hi, [[FName]].<br /><br />Are you in a good mood today?<br /><br />If for whatever reason you are not here is something that will help with<br />your day.<br /><br />As of today you are eligible to apply to receive grant funds for school.<br /><br />The amount of funds you could potentially be the recipient of? <br /><br />$5,815*!<br /><br />Funds come in the form of a check or a direct deposit, and are for<br />immediate use for schooling of some sort.<br /><br />Is you in a better mood now?<br /><br />Hopefully so!... The best part is that <em><span style="text-decoration: underline;">this money would never have to be<br />paid back.</span></em><br /><br />I bet you would be in an amazing mood if you got some funding :)<br /><br />Don&rsquo;t miss out on this (it may leave tomorrow).&nbsp; Take action now,<br />because it only takes a few minutes to get begin and discover what<br />schools you may be able to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now</strong></span></p>', NULL, '2016-09-28 18:09:32', '2016-11-08 15:41:48'),
(43, 1, 'EDU2D-IJ', '<p>Hi, [[FName]].<br /><br />How&rsquo;s your day treating you?<br /><br />Hopefully amazing!<br /><br />Just wanted to let you know that as of this morning you are eligible to<br />apply to be the recipient of grant funding for school.<br /><br />The amount that&nbsp; could be yours? <br /><br />$5,815*!<br /><br />This would be paid immediately and for use with applicable schooling.<br /><br />Wouldn&rsquo;t that be great if this worked out for you?<br /><br />Definitely yes!... The best part is that if you get it <span style="text-decoration: underline;"><em>this funding would be</em></span><br /><span style="text-decoration: underline;"><em>forgiven if you use it for school.</em></span><br /><br />How awesome is that?! <br /><br />Don&rsquo;t miss out on this (it may be gone any day now).&nbsp; Take action<br />immediately, because it only takes mere minutes to try and discover<br />what schools you may be able to attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Qualify Now</strong></span></p>', NULL, '2016-09-28 18:11:00', '2016-11-08 15:42:38'),
(44, 1, 'EDU2D-JJ', '<p>Hi, [[FName]].<br /><br />What&rsquo;s new - any good news as of late?<br /><br />If not let me bring you some!<br /><br />As of today you may still be able&nbsp; to apply to get grant funding for<br />school.<br /><br />Yes, it&rsquo;s true - up to $5,815* could be yours to use for school.<br /><br />This would be paid directly to you and is for use with eligible schools.<br /><br />How cool would that be?<br /><br />Pretty cool I bet!... The neat thing is that if you get approved <em><span style="text-decoration: underline;">this</span></em><br /><em><span style="text-decoration: underline;">funding wouldn&rsquo;t have to be repaid if you use it for school.</span></em><br /><br />Even cooler now I know! <br /><br />Don&rsquo;t be kicking yourself because you took too long to apply (it may be<br />gone very soon).&nbsp; Act now as it only takes mere minutes to find out<br />what schools you could attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span></p>', NULL, '2016-09-28 18:13:12', '2016-11-08 15:44:02');
