(45, 1, 'EDU2D-KJ', '<p>Hi, [[FName]].<br /><br />How&rsquo;s life in your neck of the woods?<br /><br />Hopefully the sun is shining and things are well!<br /><br />A quick note to perhaps brighten your day - As of this morning you still<br />have the opportunity of improving your life immensely by applying for<br />and receiving grant funds.<br /><br />Yes, funding for school of&nbsp; up to $5,815* is still available to you.<br /><br />If you were selected to receive funds to go back to school you would<br />get dollars by check or direct deposit.<br /><br />Pretty neat huh?<br /><br />The really awesome thing is that if you get approved <em><span style="text-decoration: underline;">this funding</span></em><br /><em><span style="text-decoration: underline;">wouldn&rsquo;t have to be given back if you were to use it for school.</span></em><br /><br />Yes it&rsquo;s true!<br /><br />Don&rsquo;t be lamenting going to work on Monday without knowing that you<br />took advantage of the opportunity to improve your life by returning to<br />school.&nbsp; In mere minutes you can discover what schools you could<br />attend to change your life.<br /><br /><br /><span style="text-decoration: underline;"><strong>Change Your Future Now!</strong></span></p>', NULL, '2016-09-28 18:15:21', '2016-11-08 15:45:22'),
(46, 1, 'EDU2A', '<p>Hello {FNAME}!<br /><br />I have a fun game for you.<br /><br />Let&rsquo;s see if you can guess what the 3 things below have in common.<br /><br />Getting an awarded amount of $5,815...<br />Finding out if you&rsquo;re qualified in 60 seconds..<br />Keeping every cent of your $5,815 (that you never have to pay back)<br /><br />Want the answer?<br /><br />Scroll down to get it...<br /><br />.<br /><br />.<br /><br />.<br /><br />The answer is: fr--ee grant money for college!<br /><br />It&rsquo;s true, if you are qualified you can get an awarded amount of $5,815 that you<br />never have to pay back and is yours to keep forever.<br /><br />Go here to begin the process!&nbsp; Why not take a few minutes to find out&nbsp; what<br />schools you can potentially attend and try to get yours?<br /><br /><br /><span style="text-decoration: underline;"><strong>A Direct Deposit Could Be Yours&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-28 18:20:10', '2016-11-08 15:46:17'),
(47, 1, 'EDU2B', '<p>{FNAME},<br /><br />Hallelujah!<br /><br />I thought you were dead.<br /><br />I&rsquo;m glad you&rsquo;re alive because I have great news. <br /><br />Right now you can see if you are eligible for $5,815* in grant money for school<br />that you never have to return.<br /><br />This money comes in the form of a check or direct deposit, so you can use it on<br />whatever you&rsquo;d like to (rent, supplies, car payment, etc.)<br /><br />Seeing if you have access to these funds only takes a minute.<br /><br />So what are you waiting for?&nbsp; In mere minutes you can discover what schools<br />you are potentially eligible to attend.<br /><br />There may be a check for $5,815 with your name on it.<br /><br /><br /><span style="text-decoration: underline;"><strong>Confirm Your Eligibility Now!</strong></span></p>', NULL, '2016-09-28 18:22:24', '2016-11-08 15:46:54'),
(48, 1, 'EDU2C', '<p>Hey {{Fname}}, <br /><br />I feel like it&rsquo;s important you get this message.<br /><br />The reason why is because I have some great news for you.<br /><br />Funds to spend at your leisure are being given away in your state for college<br />and it&rsquo;s possible you are eligible to receive some.<br /><br />How much is available? <br /><br />Up to $5,815*, and once you determine your eligibility they will be given to you<br />in a check or you can have it direct deposited.<br /><br />These funds can be even used for online courses, so you can further your<br />career and quality of life &mdash; from the comfort of your home or any other location<br />of your choice.<br /><br />What makes this great news even better is... none of the funds here have to be<br />paid back!<br /><br />Up to $5,815* a year can be yours to keep forever.<br /><br />It will take you less than a minute to begin the process to see if you&rsquo;re eligible<br />for $5,815. <br /><br />Begin your new career and improve your life.<br /><br /><br /><span style="text-decoration: underline;"><strong>Change Your Future Now!</strong></span><br /><br /><br />Thank you,</p>\r\n<p>Alex</p>', NULL, '2016-09-28 18:25:03', '2016-11-08 15:49:30'),
(49, 1, 'EDU2D', '<p>Hello again, [[FName]].<br /><br />Today is a wonderful day, isn&rsquo;t it?<br /><br />If you don&rsquo;t agree, I have good news to share that will change your<br />mind.<br /><br />You are eligible to apply to receive grant money for school.<br /><br />The amount that would given to you if approved is $5,815*.<br /><br />Your grant money comes in the form of a check or a direct deposit, so<br />you can spend it on whatever you&rsquo;d like.<br /><br />What&rsquo;s even better about this news is... <em><span style="text-decoration: underline;">you will never be asked to pay</span></em><br /><em><span style="text-decoration: underline;">the money back!</span></em><br /><br />I was right about this news making your day better, right?<br /><br />Don&rsquo;t let this opportunity pass you by. It only takes a few minutes to<br />get started and find out what schools that you are potentially eligible to<br />attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Stop Being a Statistic&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-28 18:26:39', '2016-11-08 15:50:54'),
(50, 1, 'EDU2E', '<p>Hello,<br /><br />By now you&rsquo;ve probably heard how Bernie Sanders plans to &ldquo;rebalance&rdquo;<br />America&rsquo;s economy.<br /><br />One of his brightest ideas (or biggest mistakes...) is to make college fr--ee for<br />students.<br /><br />Younger voters are happy about this idea, which makes me smile because of<br />what they don&rsquo;t know: there is already a way for people to get paid to go to<br />college.<br /><br />Haven&rsquo;t you heard?<br /><br />Let me explain.<br /><br />Here&rsquo;s what you do: go here to to see if you&rsquo;re eligible for $5,815 for school.<br /><br />It takes a few minutes to start.<br /><br />Most people are eligible, so don&rsquo;t worry about not being qualified.<br /><br />Eligible students receive their funds via a direct payment into a checking account<br />of your choice or mailed check. (This is great because you can spend the money<br />where you need to most.)<br /><br />Because the money is a grant and not a loan... it never has to be repaid!<br /><br />It works for online classes as well, so you can get grant money while attending<br />school from home.<br /><br />You don&rsquo;t need to elect Bernie Sanders to get paid to go to school.<br /><br />This is possible right now - find out what schools you can potentially attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span><br /><br /><br /><br />Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-28 18:28:39', '2016-11-08 15:52:02'),
(51, 1, 'EDU2F', '<p>Hey {fname},<br /><br />Here is what most get wrong.<br /><br />Making America great begins with you. You need to take control of your life and<br />make it better, instead of relying on a politician.<br /><br />But where to begin?<br /><br />Right here.<br /><br />Because once you get yourself a college level education, so you can earn the<br />money you want, doing the things you enjoy.<br /><br />It&rsquo;s never been easier to go to college than it is today. <br /><br />Here&rsquo;s why.<br /><br />Right now you can get up to $5,815* for college, even if you don&rsquo;t have a job or<br />you are not sure what to major in.<br /><br />All it takes is a simple and quick verification process that&rsquo;s 100% of no cost to<br />you.<br /><br />If you qualify, your check will be directly deposited into your bank account or<br />sent to you directly. <br /><br />Since it&rsquo;s a grant... you never have to pay it back!<br /><br />The money is yours forever.&nbsp; In mere minutes you can find out what schools<br />you may be eligible to attend.&nbsp; Why not do so now?<br /><br /><br /><span style="text-decoration: underline;"><strong>A Direct Deposit Could Be Yours&nbsp; Go Here Now!</strong></span><br /><br /><br /><br />Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:17:55', '2016-11-08 15:55:34'),
(52, 1, 'EDU2G', '<p>Good morning {FNAME},<br /><br />I bet you didn&rsquo;t know you can get up $5,815* that you never have to pay back,<br />while hanging out on your couch and learning new things.<br /><br />Sounds farfetched, I know. <br /><br />But it&rsquo;s true!<br /><br />Here&rsquo;s how it works.<br /><br />First: Click the link in this email once you&rsquo;re done reading these steps<br />Second: Answer the questions on application (it takes 1-2 minutes)<br />Third: Register for an ONLINE class about the subject of your choice<br /><br />The &ldquo;trick&rdquo; is to take online classes, so you can get money for school from the<br />comfort of your home.<br /><br />You CAN get paid to learn a new skill, so you can make more money!<br /><br />It&rsquo;s simple to begin and discover what schools you can potentially attend:<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 08:19:36', '2016-11-09 11:08:57'),
(53, 1, 'EDU2H', '<p>Hello,<br /><br />Remember that update from Jeb Bush?<br /><br />The one with a picture of colt .45 that said &ldquo;America.&rdquo;<br /><br />What are your thoughts on that?<br /><br />Anyway - random brain dump, I know. <br /><br />Now here&rsquo;s a quick reminder about something much better. <br /><br />It&rsquo;s about how to apply for fr--ee to receive a 5k scholarship for college.<br /><br />You will never have to pay it back, so you can use the money on whatever you<br />want.<br /><br />Unless the random news I mentioned a moment ago, this benefits you.&nbsp; Find out<br />now what schools you may attend with this scholarship now.<br /><br /><br /><span style="text-decoration: underline;"><strong>Good News Could be Yours! (Go Here Now)!</strong></span></p>', NULL, '2016-09-29 08:21:46', '2016-11-09 11:09:44'),
(54, 1, 'EDU2I', '<p>Hello {{Fname}},<br /><br />Finding the funds to pay for your college education should not hold you back from<br />pursuing your dreams...<br /><br />We&rsquo;ve helped thousands of people find a better way to pay for school this year<br />alone.<br /><br /><strong>Here&rsquo;s How It Works:</strong><br /><br />- Answer a few simple questions to find out if you qualify.<br />- Review a list of participating schools in your area.<br />- Decide how you want to receive your funds - by check or direct deposit.<br /><br /><strong>You may be eligible to receive up to $5,815* in your state for college.<br />These funds are entirely grant sponsored and do not have to be repaid.</strong><br /><br />If you qualify, but you\'re not sure which program is right for you - that&rsquo;s okay! You<br />don&rsquo;t have to decide right away. We&rsquo;ll provide a list of participating schools in your<br />area so you can find the best online courses to fit your needs!<br /><br />Ready to see if you&rsquo;re eligible and what schools you can potentially attend?<br /><br /><br /><span style="text-decoration: underline;"><strong>GO HERE NOW</strong></span><br /><br /><br /><br />Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:27:02', '2016-11-09 11:14:58'),
(55, 1, 'EDU2J', '<p>Good day [[FName]],<br /><br />If you\'ve ever felt overwhelmed looking for ways to pay for higher education - you<br />are not alone.<br /><br />We\'ve helped thousands of people attend college and achieve their goals - while<br />remaining completely debt-free.<br /><br />By our calculations so far, it looks like:<br /><br /><strong>You may be eligible to receive up to $5,815* to pay for school. These funds<br />are entirely grant-sponsored and do not have to be repaid.</strong><br /><br />It&rsquo;s easy to apply! Simply submit your application through the link below and:<br /><br />⧫ Find out Instantly if you qualify!<br />⧫ Discover how much you\'re eligible to receive - up to $5,815 in your state<br />⧫ Compare and choose the right classes to fit your needs!<br /><br />Click on the link below to get started!<br /><br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span></p>', NULL, '2016-09-29 08:28:47', '2016-11-09 11:16:07'),
(56, 1, 'EDU2K', '<p>Hello [[FName]],<br /><br />When Bernie Sanders first proposed the idea of making college free he was met<br />with a lot of support - and it was no surprise.&nbsp; Having college available to everyone<br />is a great idea - and it started an important conversation. &nbsp;<br /><br /><strong>What most people don\'t know is that <em>there\'s already a way to get a this</em><br /><em>education </em></strong><em><strong>right now!</strong></em><br /><br />Did you know&hellip;<br /><br /><strong>Anyone seeking a college education can to apply for up to $5,815* in grant<br />money </strong><strong>to help them pay for school?</strong><br /><br />Yes, you heard that right!<br /><br /><strong>And you can find out instantly if you qualify!</strong><br /><br />Because these funds are grant sponsored - they do not have to be paid back.<br />Which means you can take the classes you need with no upfront cost to you (and<br />no debts to pay back later!)<br /><br />You don&rsquo;t have to wait until the next election to get a free college education.&nbsp; You<br />can get it now!&nbsp; Find out what schools you are able to attend and if you can get<br />funds to attend them.<br /><br /><br /><span style="text-decoration: underline;"><strong>Apply Here to See if You&rsquo;re Eligible to Receive up to $5,815* for School!</strong></span><br /><br /><br />Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:34:38', '2016-11-09 11:18:22'),
(57, 1, 'EDU2L', '<p>Hey {fname},<br /><br />Have you been feeling the itch to go back to school but unsure where to start? Do<br />you keep putting off taking classes because you\'re not sure how you\'ll pay for<br />them? Are you unhappy at your job and looking for a fresh start?<br /><br />If you answered yes to any of these questions, then you are already taking an<br />important step by reading this, and here&rsquo;s why:<br /><br /><strong>You may be eligible to receive up to $5,815* in your state<br />{#FIELD:STATE||your state#} which you can apply towards classes in<br />your area.</strong><br /><br />This money is entirely grant funded - you will not be asked to pay it back.<br /><br />And it&rsquo;s easy to see if you qualify. Just click the link at the bottom of this letter to<br />complete a short application -<em><strong> you will find out instantly how much you are<br />eligible to receive.</strong></em><br /><br />If you do qualify you can choose the most convenient way to receive your funds,<br />either by check or direct deposit. (**Please note that these funds <span style="text-decoration: underline;">must</span> be used for<br />classes on campus or online at participating schools.)<br /><br />Getting an education should be an exciting experience - not overwhelming or<br />painful. This program is meant to empower students like you so you can get the<br />education you need and begin making positive changes in your life.&nbsp; Find out now<br />what schools that you can potentially attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Good News Could be Yours! (Go Here Now)!</strong></span><br /><br /><br />Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:37:27', '2016-11-09 11:23:26'),
(58, 1, 'EDU2M', '<p>Good morning {FNAME},<br /><br />Did you know right now you could receive up to $5,815* <em>while sitting at home on<br />your couch?</em><br /><br />It&rsquo;s true.<br /><br />There\'s just one catch&hellip;<br /><br /><strong>This money is only available to people looking to attend school.</strong><br /><br />Here&rsquo;s how it works.<br /><br />Click the link at the bottom of this email.<br />Complete a simple application to see if you qualify&nbsp; (it takes 1-2 minutes)<br />Review and register for classes of your choice.<br /><br />It&rsquo;s that simple.<br /><br />And the great thing is you&rsquo;ll never have to pay back the awarded funds!<br />(Because it&rsquo;s a grant.)<br /><br />Once you qualify you will be asked to choose how you receive your funds - you<br />can have the check mailed directly to your address or direct deposited. *The only<br />requirement is that you use the funds towards online classes of your choosing at<br />participating schools.&nbsp; See what schools you can potentially attend.<br /><br /><strong>Click the link below to get started!</strong><br /><br /><br /><span style="text-decoration: underline;"><strong>Apply for up to $5,815* to pay for online classes.</strong></span></p>', NULL, '2016-09-29 08:38:57', '2016-11-09 11:25:29'),
(59, 1, 'EDU2N', '<p>Hi [[FName]],<br /><br />In today\'s fast-paced job market getting the skills you need to get an edge over<br />the competition is more important than ever...<br /><br />&hellip; <em>And getting the funding you need</em> to pay for your education should not be an<br />overwhelming and painful process!<br /><br />We will show you how to <strong>take advantage of money that is already available<br /></strong>to you so you can start taking classes now - and get the edge you need to<br />compete in the job market.<br /><br />The entire process takes just a few minutes and you can find out instantly if you<br />qualify.<br /><br /><strong>Here\'s how it works</strong><br /><br />1. Answer a few simple questions to see if you\'re eligible to receive funds of up<br />to $5,815* in your state.<br />2. Choose how you&rsquo;d like to receive your funds (via direct deposit or check).<br />3. Compare and choose the online courses that right for you from participating<br />schools in your area.<br /><br /><br /><span style="text-decoration: underline;"><strong>Act Now!</strong></span><br /><br /><br />Best wishes,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:40:37', '2016-11-09 11:27:39'),
(60, 1, 'EDU2O', '<p>Hello {FNAME}!<br /><br />When was the last time someone told you that you could <em>get something for<br />fr--ee?</em><br /><br />My guess is you were probably skeptical right?<br /><br />Because usually the claim is just plain not true. Or, there&rsquo;s a catch.<br /><br /><strong>Well, this time it is true, and you could qualify to receive up to $5,815*<br />for fr--ee.</strong><br /><br />This money is entirely grant funded - so you really can receive the funds at no<br />cost - <em>because grant funds never have to be repaid.</em><br /><br />(and yes, there is still a catch.)<br /><br />The catch is - <em>this money is being given to students looking to pay for higher<br />education</em> - either online, or on campus.<br /><br /><strong>If you are serious about making a change and going back to school</strong>, I<br />recommend you take a few short minutes to see if you qualify. It&rsquo;s simple - and<br />you&rsquo;ll find out instantly what schools you can potentially attend along with if you<br />are eligible.<br /><br /><br /><span style="text-decoration: underline;"><strong>Click here to try to get $5,815 to pay for school</strong></span></p>', NULL, '2016-09-29 08:42:13', '2016-11-09 11:36:16'),
(61, 1, 'EDU2P', '<p>{FNAME},<br /><br />I&rsquo;m writing because it looks like <strong>you may be eligible to receive a 5k</strong><br /><strong>scholarship</strong> to pay for online classes!<br /><br />If you\'ve been thinking of taking classes online then this is definitely an<br />option to look into...<br /><br /><strong><em>These funds are entirely sponsored</em> so if the money is awarded to you,<br />you never have to pay it back. It only takes a few minutes to apply to<br />see if you qualify...</strong><br /><br />You will be guided step-by-step through a simple assessment to find out if<br />you&rsquo;re eligible to receive funds. You\'ll also find a helpful list of participating<br />schools in your area and the option to receive your funds by check or direct<br />deposit..<br /><br /><br /><span style="text-decoration: underline;"><strong>Stop Being a Statistic&nbsp; Go Here Now!</strong></span><br /><br /><br />Best wishes,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 08:44:32', '2016-11-09 11:40:04'),
(62, 1, 'EDU2Q', '<p>Good morning {FNAME},<br /><br />Looking for a way to take classes online - without going into loads of debt?<br /><br />We\'ve helped thousands of students get scholarships of 5k to help them pay<br />for their education.<br /><br /><strong>This funding is <em>not based on competition</em> <em>but on eligibility alone</em> - so you<br />have nothing to lose to see if you qualify.</strong><br /><br /><strong>It\'s easy! Just follow these simple steps:</strong><br /><br />1. Complete an application - it only takes a couple minutes!<br />2. Instantly find out if you qualify and how much you&rsquo;re eligible to receive.<br />3. Choose how you want to receive your funds - via direct deposit or check.<br />4. Check out a list of participating schools in your area to find the right classes<br />for you. Then register<br /><br /><strong>Get yours now - it\'s only a click away:</strong><br /><br /><br /><span style="text-decoration: underline;"><strong>&nbsp;Time is Limited&nbsp; Go Here Now!</strong></span></p>', NULL, '2016-09-29 10:07:01', '2016-11-09 11:44:09'),
(63, 1, 'EDU2R', '<p>Hey there,<br /><br />Have you ever been told that going to college is a huge investment? That if<br />you\'re looking to update your skills and take classes you\'ll also have to take on<br />huge amounts of debt?<br /><br />Paying for college can be a hassle - and expensive!. <strong>Luckily there are other<br />options available to you to pay for school - and walk away without any<br />debt.</strong> But you\'ll never hear this from education credit lenders desperately trying<br />to protect their turf - and collect your money in the process...<br /><br />The truth is that there\'s a lot of funds out there to help you pay for school. <em>And</em><br /><em>money that is grant sponsored never has to be paid back. Ever.</em><br /><br /><strong>You could receive a 5k scholarship completely fr--ee - and have it sent<br />to you directly via check or direct deposit.</strong><br /><br />The entire application process takes just a few minutes. Simply click the link<br />below and answer a few simple questes to get started. You&rsquo;ll find out instantly if<br />you qualify and how much you&rsquo;re eligible to receive for school.<br /><br />Ready to get started?&nbsp; You never know til you try right?<br /><br /><br /><span style="text-decoration: underline;"><strong>With Nothing to Lose Why not Take 2 Minutes to See If You Qualify</strong></span></p>', NULL, '2016-09-29 10:08:28', '2016-11-09 11:46:05'),
(64, 1, 'EDU2S', '<p>Greetings!<br /><br />Sending you a friendly reminder that<strong> you may be eligible to receive up to<br />$5,815* in grant funds to pay for your higher education.</strong><br /><br />It only takes a few minutes to see if you qualify.<br /><br />Here&rsquo;s how it works:<br /><br />1. Fill out a simple application through the link below. (Don&rsquo;t worry - It only takes<br />a few minutes to complete!)<br />2.Find out instantly how much you&rsquo;re eligible to receive - and choose how you&rsquo;d<br />like to receive your funds (via check or direct deposit)<br />3. Review the classes available at participating schools - and find the best<br />courses that fit your needs.<br /><br /><em>These funds are awarded through state-sponsored educational grants.</em> This<br />means that the money awarded does not have to be repaid - <em>so you can attend<br />school completely debt-free!</em><br /><br /><br /><span style="text-decoration: underline;"><strong>Get Yours Today!</strong></span></p>', NULL, '2016-09-29 10:10:33', '2016-11-09 11:50:36'),
(65, 1, 'EDU2T', '<p><strong>{fname},</strong><br /><br />Do you want to go to college? Do you want to go back to college? Maybe just<br />take a few classes online to update a skill-set you already have?<br /><br />Why?<br /><br />Is it so you can see bigger paychecks coming your way? Maybe trade your job<br />for a better one, start your own business, or just open up your options?<br /><br /><strong>Whatever your reason for going back to school there\'s one thing I\'m<br />certain of:</strong><br /><br /><em><strong>You\'re not going back to school so you can get into debt!</strong></em><br /><br />Unfortunately, for most people going back to school - the path does lead to<br />debt and further financial burdens.<br /><br /><strong>This is totally counterproductive.</strong><br /><br />And doesn\'t have to be that way!<br /><br /><em>That\'s because there is already money available - up to $5.815.* This money is<br />entirely grant funded - and never has to be repaid.</em><br /><br />Thousands of people have already tapped into this hidden economy to get the<br />education they need without being straddled with debt.<br /><br />Why not you?<br /><br />You may be eligible to receive up to $5,815 in grant money - that\'s money you<br />never have to pay back.<br /><br /><strong>Just take these simple steps to find out if you qualify:</strong><br /><br />Complete a simple application to see if you qualify.<br />Choose how you&rsquo;d like the funds delivered to you - via direct deposit or<br />check.<br />Review a list of participating schools in your area and decide which<br />courses are right for you.<br /><br />That\'s it!<br /><br />You have nothing to lose. Apply today!<br /><br /><br /><span style="text-decoration: underline;"><strong>Change Your Future Now!</strong></span><br /><br /><br />Best wishes,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 10:12:39', '2016-11-09 11:59:46'),
(66, 1, 'EDU3A', '<p>Dear (name), <br /><br />Bernie Sanders wants to make college free. That would be awesome, right?<br /><br />But Bernie probably won&rsquo;t win the democratic nomination. So no cost college <br />will likely never happen.<br /><br />But you can still get $5,815 for college right now during Obama&rsquo;s presidency.<br />Many people are unaware of this grant, so we&rsquo;re spreading <br />the word.<br /><br />Are you eligible for this grant? To find out if you can get this&nbsp; $5,815 <br />grant for school, click here. Remember, it&rsquo;s a grant. So you don&rsquo;t have to pay it back.<br /><br />It can be used for online classes, or to physically attend a college or University of your<br />choice.<br />If you&rsquo;re approved, you can have the funds mailed to you in a check, or deposited into<br />your checking account. (direct deposits can take 1-3 business days)<br /><br />Since it likely won&rsquo;t be offered in 2017, now is the time to act. <span style="text-decoration: underline;"><strong>Click here</strong></span> to see if you<br />qualify<br />for this no cost grant today. <br /><br /><br />Sincerely,<br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:15:46', '2016-11-09 12:03:25'),
(67, 1, 'EDU3B', '<p>Dear (name),<br /><br />If you&rsquo;re serious about going to college, then how about $5,815 to help you out.<br /><br /><em>How?</em><br /><br />Even with all the arguing over building a wall, and what was in Hillary&rsquo;s emails, <br />there&rsquo;s something beautiful happening right now under the Obama administration&hellip;<br /><br />It&rsquo;s a no cost grant of up to $5,815 that many people don&rsquo;t know exists. <br />So we&rsquo;re spreading the word before it disappears at the end of 2016. <br /><br />Click here to see if you qualify for the $5,815&nbsp; grant <br /><br />Now&rsquo;s the time to improve your future. And remember, because it&rsquo;s a grant, <br />you don&rsquo;t have to pay it back.&nbsp;&nbsp; Find out now what schools that you are eligible to<br />attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>(click to see if you qualify)</strong></span><br /><br /><br />Sincerely, <br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:17:30', '2016-11-09 12:05:47'),
(68, 1, 'EDU3C', '<p>Dear (name),<br /><br />You could be enrolled in a college of your choice come Spring Semester. For free. <br /><br />It&rsquo;s quite possible you could qualify for a $5,815 educational grant. And because it&rsquo;s a<br />grant, you won&rsquo;t have to pay it back.<br /><br /><em>Click here to see if you are eligible for this grant.</em><br /><br />The bad news? This no cost grant will likely end at the start of 2017. So make <br />this Spring the season for growing your mind, and improving your financial stability<br />&mdash;with a<br />free start on a great education.<br /><br /><em>Check now to see if you qualify.</em><br /><br />If you qualify (97% of people do) then you can have your educational money<br />mailed to you in a check, or directly deposited into your bank account in <br />1-3 business days. And remember, because it&rsquo;s a grant, not a loan, you don&rsquo;t<br />have to worry about paying it back. <br /><br /><br /><span style="text-decoration: underline;"><strong>(Do I qualify?)</strong></span><br /><br /><br />Sincerely, <br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:19:51', '2016-11-09 12:07:03'),
(69, 1, 'EDU3D', '<p>Dear (name)<br /><br />It&rsquo;s true. The best grants that are offered often fly under the radar. So I&rsquo;m guessing<br />there&rsquo;s a good chance you don&rsquo;t know about the $5,815 no cost grant that&rsquo;s out there.<br /><br />It&rsquo;s an awesome grant that is currently available to you. It allows<br />you to choose the college of your choice &mdash;on campus or online classes &mdash;and gives<br />you<br />up to $5,815 towards tuition and expenses. <br /><br />Check now to see if you qualify for this grant<br /><br />And because it&rsquo;s a grant &mdash;not a loan &mdash;you never have to pay it back. Obviously they<br />don&rsquo;t want everyone jumping on this grant, so it&rsquo;s not like they&rsquo;re advertising <br />for it. Believe it or not a large # of people are approved for this. <br /><br />This grant will likely end soon. So if you want <br />to take advantage of this no cost educational grant, then act soon.<br /><br /><br /><span style="text-decoration: underline;"><strong>Check and see if you qualify for this educational grant today</strong></span><br /><br /><br />Sincerely, <br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:22:07', '2016-11-09 12:11:39'),
(70, 1, 'EDU3E', '<p>Dear (name),<br /><br />They say ignorance is bliss. But in this case, ignorance is simply cheating you<br />out of $5, 775.<br /><br />What am I talking about?<br /><br />I&rsquo;m talking about a&nbsp; grant that you probably didn&rsquo;t even know existed.<br />It&rsquo;s giving people like you $5,815 towards the education of their choice. And the<br />best part is that because it&rsquo;s a grant, not a loan, you won&rsquo;t have to pay it back.<br /><br /><em>Check now to see if I qualify for this no cost grant</em><br /><br />This grant&nbsp; will give you a great start on your education. If approved, you can opt to<br />have a check mailed to you, or to have the grant directly deposited into your bank<br />account within 1-3 business days.<br /><br /><em>Do I qualify?</em><br /><br />You won&rsquo;t be getting a letter pleading with you to take advantage of this amazing grant.<br />They are counting on thousands of people staying oblivious to this grant until it<br />disappears at the end of 2016.<br /><br />Take advantage of this&nbsp; now and get your education taken care of while you still can. <br /><br /><br /><span style="text-decoration: underline;"><strong>Check now.</strong> </span><br /><br /><br />Sincerely, <br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:24:08', '2016-11-09 12:13:11'),
(71, 1, 'EDU3F', '<p>Dear (name)<br /><br />There&rsquo;s a way to get a no cost $5,815 grant for your education right now. You don&rsquo;t<br />have to pay it back, either. It&rsquo;s a legitimate grant, not a loan.<br /><br />Find out if you qualify now<br /><br />I applaud Bernie Sanders for his bold thinking. College tuition absolutely should be<br />free.<br /><br />But since Bernie got smoked in the New York primary, and looks to be a long-shot to<br />become the next president, this $5,815 educational grant may be the closest thing to<br />no cost college you&rsquo;ll find. <br /><br /><br /><span style="text-decoration: underline;"><strong>Find out if you&rsquo;re eligible</strong> </span><br /><br /><br />This awesome grant will likely be stopped at the beginning of 2017. So act<br />now and get up to $5,815 of money for your education. <br /><br /><br />Sincerely,<br /><br />Alex<br />Educational Services<br /><br /></p>', NULL, '2016-09-29 10:25:52', '2016-11-09 12:14:32'),
(72, 1, 'EDU3G', '<p>Dear (name),<br /><br />There&rsquo;s only 3 semesters left for you to put your free $5,815 towards your education. <br /><br />Remember me? I told you there&rsquo;s a grant out there that 97% of applicants qualify for.<br />Unfortunately, this awesome government grant may disappear with Obama&rsquo;s<br />presidency. It&rsquo;s a legitimate grant that will pay for tuition and educational <br />expenses at the college of your choice &mdash;on line classes or on campus classes.<br /><br /><em>Check now to see if you qualify</em><br /><br />This isn&rsquo;t something you can dismiss as &ldquo; too good to be true. &ldquo; Thousands of people<br />have<br />used this grant to help pay for their higher education. But the sad truth is that only a<br />fraction<br />of people are aware of this opportunity. &nbsp;<br /><br />We&rsquo;re out to change that.<br /><br /><br /><span style="text-decoration: underline;"><strong>Check here to see if you qualify</strong></span><br /><br /><br />Sincerely,<br /><br /><br />Adam Wright<br />Educational Services</p>', NULL, '2016-09-29 10:27:51', '2016-11-09 12:15:32'),
(73, 1, 'EDU3H', '<p>Dear (name)<br /><br />I hate emails that start with some cheesy line trying to pull you in. Thankfully,<br />I don&rsquo;t need to rely on that. <br /><br />I&rsquo;m just letting you know there&rsquo;s a legitimate grant out there that<br />is putting up to $5,815 in people&rsquo;s pockets to put towards their education.<br />Not enough people know about this grant. It may cease at the end of 2016,<br />when Obama makes his grand exit from The White House. <br /><br /><em>Click here to see if you&rsquo;re eligible for this free grant now</em><br /><br />If approved, the money will either be mailed to you, or directly deposited into<br />your bank account. (deposits can take 1-3 business days) You get to choose<br />the college, and whether you want to take online or on campus classes.<br /><br /><br /><span style="text-decoration: underline;"><strong>Check here to see if you qualify and find out what schools you can potentially attend</strong></span></p>\r\n<p><br />Sincerely,</p>\r\n<p>Alex<br />Educational Services</p>', NULL, '2016-09-29 10:29:16', '2016-11-09 12:18:24'),
(74, 1, 'EDU3I', '<p>Dear (firstname), <br /><br />I graduated with my University degree last semester. I ate Ramen every night and<br />worked 2 jobs while taking classes, so I could afford tuition for my final semester&hellip;<br /><br />And guess what?<em> It turns out I didn&rsquo;t have to.</em><br /><br />But it wasn\'t until after I graduated that I found out about a grant<br />that would&rsquo;ve given me $5,815 to help pay for my education.<br /><br />I was sick to my stomach&hellip;<br /><br />But instead of crying about it, I decided to make sure that other struggling students<br />were<br />aware of this grant so they can focus more on classes and less on expenses. <br />And since it&rsquo;s a grant, not a loan, students won&rsquo;t ever have to pay it back.<br /><br />Good News Could be Yours! (Go Here Now)!<br /><br />If I were you, I wouldn&rsquo;t wait around. When the Obama administration ends &nbsp;<br />this may no longer be available. Thankfully, you have some time to work with. Your<br />education awaits.&nbsp; Find out what schools you might qualify with aid to attend to.<br /><br /><br /><span style="text-decoration: underline;"><strong>Time is Limited&nbsp; Go Here Now!</strong></span><br /><br /><br />Sincerely,<br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:30:36', '2016-11-09 12:19:51'),
(75, 1, 'EDU3J', '<p>Dear (name),<br /><br />I really can&rsquo;t stand being nagged. So obviously nagging you would be on my list <br />of things not to do&hellip;<br /><br />But I do want to remind you that there is $5,815 out there waiting on you to put <br />towards your education. It&rsquo;s a legitimate, grant and it will likely cease being available<br />very soon.<br /><br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span><br /><br /><br />Thousands of students have used this grant to help pay for their education.<br />Don&rsquo;t wait until it&rsquo;s too late to get your grant. It could mean a ton for your future.<br /><br />Do I qualify?&nbsp; Find out now what schools you may be eligible to attend.<br /><br /><br />Sincerely,<br /><br />Alex</p>', NULL, '2016-09-29 10:33:07', '2016-11-09 12:20:42'),
(76, 1, 'EDU3K', '<p>Dear (name),<br /><br />I love those Directv commercials starring &ldquo; The Settlers.&nbsp; &ldquo; They&rsquo;re pretty hilarious.<br /><br />But what bothers me, is that people really do tend to settle in life. One great remedy <br />for complacency is to make yourself more valuable through getting a higher education. <br /><br />There&rsquo;s an awesome $5,815&nbsp; grant you could be eligible for. A large number of people<br />that apply are approved. The worst thing about this grant? Not many people know<br />about it.<br /><br /><br /><span style="text-decoration: underline;"><strong>This Is a Limited Time Opportunity&nbsp; Take Advantage of It Now!</strong></span><br /><br /><br />The other bad part about this educational grant is that it may end when president<br />Obama leaves office, so you have until the end of 2016 to utilize it. That&rsquo;s 3 full<br />semesters. With a&nbsp; $5,815 grant at your back, it could be a move that dramatically<br />improves your life. <br /><br /><em>Am I eligible?</em><br /><br />Remember, this is a&nbsp; grant, not a loan. So you won&rsquo;t have to pay back any money.<br />You can take classes online, or on campus with these funds. Find out now what<br />schools you are eligible to attend.<br /><br /><br />Sincerely,<br /><br />Alex<br />Educational Services</p>', NULL, '2016-09-29 10:35:02', '2016-11-09 12:22:53'),
(77, 1, 'EDU3I-C', '<p>Hello {FNAME}<br />&nbsp;<br />What if someone told you that you could get college funds that you do not have<br />to pay back?<br />&nbsp;<br />You would most likely be skeptical, right?<br />&nbsp;<br />More often than not, there is usually a catch to it.<br />&nbsp;<br />But this time there is no catch, as you could really qualify to receive up to<br />$5,815.<br />&nbsp;<br />The money is entirely grant funded and will therefore not be repaid.<br />&nbsp;<br />These funds are being given to students looking to pursue a higher education<br />either online or on campus.<br />&nbsp;<br />If you are serious about making a change and going back to school this is the<br />time to do it. Simply apply and in a few minutes you will find out if you are<br />eligible and see what schools you may attend.<br /><br /><br /><span style="text-decoration: underline;"><strong>Solve Your Money Problems&nbsp; Go Here Now!</strong></span><br /><br /><br />Best,<br /><br />Alex</p>', NULL, '2016-09-29 10:36:27', '2016-11-09 12:25:42'),
(78, 1, 'EDU3J-C', '<p>{FNAME}<br />&nbsp;<br />Did you know that you may be eligible for funding up to $5,815<br />in your state to pay for online classes?<br />&nbsp;<br />If you have been thinking about taking online college classes<br />then take this chance to find out how to go about it.<br />&nbsp;<br />The monies are entirely grant sponsored so if the money is<br />awarded to you, you never have to pay it back.</p>\r\n<p><strong>It only takes a couple of minutes to apply and find out if you<br />qualify.</strong><br />&nbsp;<br />All you need to confirm your eligibility to receive funds is to go<br />through a guided step-by-step assessment.<br />You will also find a helpful list of participating schools in your<br />area to help you choose the one that works best for you.</p>\r\n<p>Once confirmed you have the option to receive your funds either<br />by check or direct deposit.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Apply here and find out if you qualify today!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 10:44:19', '2016-10-10 12:03:44'),
(79, 1, 'EDU3K-C', '<p>Good morning {FNAME},<br />&nbsp;<br />Are you a student looking to pursue to a college education without getting into<br />huge debt?<br />We are here to help students get up to $5,815 in grant money to help them pay<br />for their college education.<br />&nbsp;<br />The funding is based on eligibility not on competition as long as the funds are<br />available so you have nothing to lose to see if you qualify.<br />&nbsp;<br />It\'s easy! Just follow these quick steps:<br />1. Complete an application to check your eligibility.<br />2. Instantly find out if you qualify and how much you&rsquo;re eligible to receive.<br />3. Choose the method by which to receive the funds either by check or direct<br />deposit.<br />4. Go through a provided list of participating schools in your area to find the<br />best fit for you. Then register and you are on your way to earning a college<br />degree.<br /><br /><br /><span style="text-decoration: underline;"><strong>Get yours NOW - it\'s only a click away!</strong></span></p>', NULL, '2016-09-29 10:48:54', '2016-11-09 17:19:54'),
(80, 1, 'EDU3L', '<p>Hello,<br />&nbsp;<br />Whenever we hear about getting a college education, there is always a huge<br />monetary attachment to it. We therefore think that to update our skills or take<br />college classes we need to take on large amounts of debt.<br />&nbsp;<br />Paying for college can sound complicated and expensive but it need not be.<br />There are options that can help you pay for tuition and graduate without<br />student loans - something that education credit lenders do not want you to<br />know. The truth is there is grant money available to help you pay for school<br />and best of all is the money does not need to be repaid.<br />&nbsp;<br />The entire application process requires just a few minutes. Simply click on the<br />link below and answer a few questions to find out if you qualify and how much<br />you are eligible for.<br />&nbsp;<br /><span style="text-decoration: underline;"><strong>APPLY NOW for up to $5,815* in grant money to pay for your<br />college education.</strong></span></p>', NULL, '2016-09-29 11:00:19', '2016-11-09 17:26:03'),
(81, 1, 'EDU3M', '<p>&nbsp;Hello,<br /><br /><br />This is a friendly reminder that you may be eligible to receive up to $5,815 in<br />grant funding to help you pay for college.<br /><br /><br />Here is how it works:<br />1. Click on the link below and fill out a simple application. (Don&rsquo;t worry-<br />this will only take a couple of minutes to complete).<br />2. You will immediately find out how much you are eligible for and you<br />can choose whether you would like to receive the funds via direct<br />deposit or check.<br />3. Assess the participating colleges and pick classes at the school<br />that best meets your requirements.<br /><br /><br />The monies are provided for through state educational programs and therefore<br />do not have to be repaid.<br /><br /><br /><span style="text-decoration: underline;"><strong>Apply today if you want to attend college without worrying<br />about tuition.</strong></span></p>', NULL, '2016-09-29 11:02:38', '2016-11-09 17:27:23'),
(82, 1, 'EDU3N', '<p>{FNAME},<br /><br />Did you attend college but never got the chance to graduate due to lack of<br />tuition? Do you want to take additional classes to enhance your existing skills?<br />Do you simply want to attend college for the first time?<br /><br />The idea seems daunting when you consider the rising cost of college tuition.<br />You simply do not want to attend school and cause more financial burden on an<br />already tight budget or graduate with debt.<br /><br />The good news is there are advantageous ways to finance college that you<br />may not be aware of.<br /><br />Did you know that there is grant funding available up to $5,815? Many people<br />have already utilized this hidden opportunity to get the education they need<br />without mounting debt.<br /><br />You too can be a beneficiary.<br /><br />Follow the simple steps below to find out if you qualify:<br />1.&nbsp;&nbsp;&nbsp;&nbsp; Fill in the straightforward application to see if you qualify.<br />2.&nbsp;&nbsp;&nbsp;&nbsp; Select how you would like the funds disbursed to you either by check or<br />direct deposit.<br />3.&nbsp;&nbsp;&nbsp;&nbsp; Consider the participating colleges and pick the classes that best suit you.<br /><br /><br /><span style="text-decoration: underline;"><strong>Apply today and earn an education that gives you an edge over<br />the rest.</strong></span><br /><br /></p>', NULL, '2016-09-29 11:05:45', '2016-11-09 17:28:52'),
(83, 1, 'EDU-RW1', '<p>Hello again, [[FName]].<br /><br />Fact: today IS amazing.<br /><br />Agree or disagree?<br /><br />If you disagree, here&rsquo;s some GREAT news that&rsquo;ll change your<br />mind.<br /><br />You are eligible to receive grant money to attend schools in your<br />area.<br /><br />After picking a college of your choice, the total amount of grant<br />funds made available to you is $5,815*.<br /><br />This grant money comes in the form of a check or direct deposit,<br />which means you&rsquo;ll have the freedom to spend it on whatever you<br />want.<br /><br /><strong>What makes this amazing news is... <span style="text-decoration: underline;"><em>you will NEVER be asked</em></span></strong><br /><strong><span style="text-decoration: underline;"><em>once to pay the grant funds back!</em></span></strong><br /><br />Once accepted (which most are), you&rsquo;ll be on track to improving<br />your future with a college education AND having the comfort and<br />security of getting paid to go to college!<br /><br />Starting out is SUPER simple. <br /><br />Simply visit the button below that says &ldquo;Go Here Now&rdquo; to see<br />available schools in your area!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:07:26', '2016-11-09 17:30:52'),
(84, 1, 'EDU-RW2', '<p>Hey [[FName]].<br /><br />How&rsquo;s your day going?<br /><br />If things could be better, here&rsquo;s some AMAZING news...<br /><br />There&rsquo;s a program available to you right now that provides $5,815*<br />in grant money to attend schools in your area.<br /><br />After selecting a school of your choice, your grant money comes<br />in the form of a check or direct deposit, so you use it however you<br />want.<br /><strong>What makes this amazing news is... </strong><em><span style="text-decoration: underline;">you will NEVER be asked</span></em><br /><em><span style="text-decoration: underline;">once to pay the money back!</span></em><br /><br />If you would like to get started with building a future with an<br />advanced education AND having the security of getting paid to go<br />to college...<br /><br />Click the button below that says &ldquo;Go Here Now&rdquo; to see available<br />schools in your area!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:09:29', '2016-11-09 17:32:15'),
(85, 1, 'EDU-RW3', '<p>Hi [[FName]]!<br /><br />Having a good day so far?<br /><br />If you want to make today AMAZING, check this out...<br /><br />You&rsquo;re eligible to receive $5,815* in grant money to attend schools<br />in your area.<br /><br />After selecting a school of your choice, your $5,815* in grant<br />money can be yours via check or direct deposit, so you have<br />instant and DIRECT access to the funds.<br /><br /><strong>Also, since it&rsquo;s a grant (and NOT a loan)... </strong><span style="text-decoration: underline;"><em>you will NEVER have to<br />give back the funds!</em></span><br /><br />If getting a college education is what you want, but you never had<br />access to a way to pay for it...<br /><br />Then click the button below that says &ldquo;Go Here Now&rdquo; to check<br />out available schools in your area!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:11:32', '2016-11-09 17:33:33');
