(86, 1, 'EDU-RW4', '<p>Howdy [[FName]]!<br /><br />Day going great so far?<br /><br />Sure hope so...<br /><br />Because I have some amazing news for you today!<br /><br />There is $5,815* in grant funds available to you...<br /><br />And after selecting a school of your choice, you can have this<br />grant money sent to you DIRECTLY in the form of a check or<br />direct deposit!<br /><br />Since the grant funds are NOT a loan...<br /><br />You will NEVER have to pay the money back!<br /><br />It is yours to keep forever, which makes getting started with<br />college as easy as tying your shoes.<br /><br />All you have to do to begin is choose what school you&rsquo;d like to<br />attend, and following the simple instructions given to you.<br /><br />Good luck!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:12:48', '2016-11-09 17:34:30'),
(87, 1, 'EDU-RW5', '<p>Hello [[FName]]<br /><br />Catch you at a good time?<br /><br />This&rsquo;ll only take a sec...<br /><br /><strong>After visiting this page and choosing a college of your choice,</strong> you<br />are eligible to receive $5,815* in grant funds!<br /><br />You are able to choose whether your grant funds are sent to you<br />via check or direct deposit...<br /><br />Which means you can use your funds on WHATEVER you want!<br /><br />Because the $5,815* comes in the form of a GRANT... <em><span style="text-decoration: underline;">you will</span></em><br /><em><span style="text-decoration: underline;">never have to pay it back!</span></em><br /><br />All it takes to get started is clicking the button below that says &ldquo;Go<br />Here Now&rdquo; and following the simple instructions on the next page:<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:14:15', '2016-11-09 17:35:35'),
(88, 1, 'EDU2D-RW6', '<p>[[FName]]<br /><br />If you&rsquo;ve been thinking about attending college...<br /><br />BUT you were unsure about how to pay for it...<br /><br />Then I have the most AMAZING news for you!<br /><br />You are now eligible to apply to receive $5,815* in grant money<br />after attending the college of your choice!<br /><br />All you have to do is register for one semester or more to receive<br />the funds... <br /><br />And that&rsquo;s not even the best part.<br /><br />The best is because they are GRANTS...<br /><br />You will never be asked once to pay the money back!<br /><br />To get started with this awesome opportunity, visit the link that<br />says &ldquo;Qualify Now&rdquo; to see available schools in your area!<br /><br /><br /><span style="text-decoration: underline;"><strong>Qualify Now!</strong></span></p>', NULL, '2016-09-29 11:15:56', '2016-11-09 17:36:31'),
(89, 1, 'EDU2D-RW7', '<p>[[FName]]<br /><br />Been thinking about going to college?<br /><br />Would you like to go, but you don&rsquo;t have money to attend? <br /><br />How awesome would it be if you could get PAID to become a<br />student at the college of your choice?<br /><br />If you answered, &ldquo;Yes, yes, and YES!&rdquo;...<br /><br />Then here is some ABSOL-FRIGGIN-LUTELY amazing news!<br /><br />You are now eligible to get $5,815* in grant money, so you can get<br />help with attending any college you want!<br /><br />All you have to do to get started is visit the link below that says<br />&ldquo;Go Here Now&rdquo; and follow the instructions to see what schools<br />are available in your area.<br /><br />Good luck!<br /><br /><br /><span style="text-decoration: underline;"><strong>Apply In Mere Minutes (Now)!</strong></span></p>', NULL, '2016-09-29 11:18:07', '2016-11-09 17:37:23'),
(90, 1, 'EDU2D-RW8', '<p>[[FName]]<br /><br />Got plans for college, but don&rsquo;t have the funds to attend?<br /><br />If so, then here is some amazing news!<br /><br />Right now you can get $5,815 in grant funds for college, and have<br />it directly sent to you as a check or direct deposit.<br /><br />(Can I get an AMEN?)<br /><br />Stop struggling with figuring out how to pay for school. <br /><br />And use this grant money that&rsquo;s directly deposited into your<br />banking account OR sent as a check.<br /><br />Once you choose a college of your choice, you will be eligible to<br />apply for these grant funds.<br /><br />Click the button that says &ldquo;Go Here Now&rdquo; to choose the college of<br />your choice!<br /><br /><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>', NULL, '2016-09-29 11:24:56', '2016-11-09 17:38:31'),
(91, 1, 'EDU2D-RW9', '<p>[[FName]]<br /><br />Hey buddy.<br /><br />Passing along some news to you I think would help.<br /><br />There&rsquo;s this incentive program right now for going to<br />college where they give you $5,815 in grant funds. <br /><br />Maybe you&rsquo;ve heard of it... maybe you haven&rsquo;t. <br /><br />The great thing about this program is, unlike loans...<br />you will NEVER be asked to pay the money back!</p>\r\n<p><br />Cool program, right?<br /><br />It&rsquo;s easy to get started with it. <br /><br />Just visit the link below that says &ldquo;Go Here Now&rdquo; to see<br />the colleges available for this program in your area.</p>\r\n<p>That&rsquo;s all there is to it. <br /><br />Here&rsquo;s the link I told you about (click it!):</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:26:33', '2016-11-09 17:32:47'),
(92, 1, 'EDU2D-RW10', '<p>Whoa [[FName]]...<br /><br />This just popped on my radar.<br /><br />And since it&rsquo;s about how to get paid to go to college,<br />I thought you&rsquo;d be interested in this.</p>\r\n<p><br />Here&rsquo;s how it works...<br /><br />After picking what college you want to attend, you&rsquo;ll<br />be&nbsp; eligible to receive $5,815 in grant funds that are<br />DIRECTLY sent to you via checking account or check.<br /><br />The cool thing about this is, since they&rsquo;re grant funds...<br /><em>you will never have to pay the funds back!</em><br /><br />Isn&rsquo;t that cool, buddy?<br /><br />Haha... I agree.<br /><br />Now here&rsquo;s how to get started with this program.</p>\r\n<p>Visit the link below that says &ldquo;Get Yours Now&rdquo; and<br />follow the instructions on the next page.<br /><br />That&rsquo;s it!<br /><br />Here&rsquo;s the link (click it!):</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Get Yours Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:28:10', '2016-11-09 17:34:51'),
(93, 1, 'EDU2D-RW11', '<p>Hello again, [[FName]].<br /><br />Imagine this...<br /><br />You sit down for breakfast and take a sip of coffee.<br /><br />As you look down at the table, you notice a bill.<br /><br />A big, WHOOPING bill for $27,348.<br /><br />You sigh ...at first.<br /><br />But then, you shrug your shoulders, and you begin to laugh.<br /><br />You&rsquo;re laughing because 10 years ago, a bill this large would<br />have made you worried.</p>\r\n<p><br />But today?<br /><br />Not at all.<br /><br />And the ultimate reason why you&rsquo;re able to write a check for<br />$27,348 to pay off your new boat, and take your family to any<br />exotic location around the world, is because of ONE decision<br />you made 10 years from today.<br /><br />What was that ONE decision?<br /><br />It was the decision to <strong>pursue a college education</strong>, which lead<br />to securing yourself financially for the rest of your life.<br /><br />You were hesitant to go to college, at first.<br /><br />What changed your mind was the NEW incentivized program<br />that provides $5,815 to eligible &amp; qualified students.<br /><br />It was thanks to these nice chunk of Grant money, you were<br />able to choose the major you wanted to pay the lifestyle you<br />dream of.<br /><br />Today, [[FirstName]], you have a choice.<br /><br />You can choose to either stay stuck in a life of working job to<br />job, barely getting by...<br /><br />Or you can choose to change your life for the better.</p>\r\n<p><br />The choice is yours.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Change Your Life Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:30:02', '2016-11-09 17:35:46'),
(94, 1, 'EDU2D-RW12', '<p>Hey [[FName]].<br /><br />What if your life went like this?<br /><br />You wake up every morning, stress free.<br /><br />You&rsquo;re able to not worry about bills, because you have a steady stream of income thanks<br />to your well-paying, full-time job.<br /><br />Wouldn&rsquo;t that be amazing?<br /><br /><strong>Making it happen begins here</strong> after you choose a college of your choice and get education<br />that pays you back for the rest of your life!<br /><br />Attending college is easy right now, because there is $5,815* in Grant Funds waiting for<br />you if you qualify.<br /><br />These funds are great for you because... they are yours to keep forever!<br /><br />Since you don&rsquo;t have to pay the Grant Funds back, you have no excuse not to pursue a<br />college level education that helps you live the life of your dreams.<br /><br />Getting started is SIMPLE.<br /><br />Just click the link below that says &ldquo;Take Advantage of This Now!&rdquo; to see what colleges are<br />available to you.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:31:29', '2016-11-09 17:36:42'),
(95, 1, 'EDU2D-RW13', '<p>Imagine if this was your life...<br /><br />Every morning you wake up, stress free.<br /><br />Bills don&rsquo;t worry you, because your well-paying, full-time job keeps you<br />financially stable and secure.<br /><br />Is that the life you want?<br /><br /><strong>Living the life you want begins here</strong>, and once you&rsquo;ve chosen a college<br />of your choice, here&rsquo;s where things get every better.<br /><br />If you choose to go to college, you will want to also take advantage of<br />the $5,815 in grant funds available if you qualify.<br /><br />The great things about these funds is you never have to pay them back!<br /><br />Taking advantage of this is simple.<br /><br />Simply click the link below that says &ldquo;Take Advantage of This Now!&rdquo; to<br />checkout nearby colleges and taking advantage of the $5,815 in grant<br />funds if you qualify.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:32:40', '2016-11-09 17:37:27'),
(96, 1, 'EDU2D-RW14', '<p>Imagine if your evening went like this:<br /><br />You sit down on your couch and crack a smile...<br /><br />You&rsquo;re smiling because you have everything you need to<br />live your life free from stress and financial worries.<br /><br />You can live this type of life...<br /><br /><strong>And here is where it all begins</strong>, because once you choose<br />a college and a major, you can get a well-paying job that<br />supports you and your family.<br /><br />Because it&rsquo;s so easy to go to college today, thanks to the<br />$5,815 in Grant Funds available if you qualify, there is ZERO<br />excuse not to improve your future.<br /><br />Because the Grant Funds are not a loan,<br />you never have to pay them back!<br /><br />So if the idea of changing your life for the better, and<br />getting $5,815 in Grant Funds interests you, visit the link<br />below that says &ldquo;Change Your Life Now&rdquo; to get started!</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Change Your Life Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:34:13', '2016-11-09 17:38:02'),
(97, 1, 'EDU2D-RW15', '<p>Let&rsquo;s fast-forward your life for a moment...<br /><br />Imagine yourself never having to worry or stress out about bills.<br /><br />Think of how awesome that would be.<br /><br />Looking back at your life, you will have been in the financially free<br />situation you&rsquo;re because of ONE simple decision.<br /><br /><strong>After visiting this page and following the instructions</strong>, you can<br />get one step closer to living a happy, long, and wealthy life because<br />you&rsquo;ll have a college education.<br /><br />To help you get started, be sure you ask about the $5,815 in Grant<br />Funds that you NEVER have to pay back if you qualify.<br /><br />These funds are there to assist you with getting started, and you<br />have have them as a check or a direct deposit...<br /><br />Can you say, ka-ching?<br /><br />Today&rsquo;s the day you take advantage of this opportunity.<br /><br />Click the link below to get started by checking out colleges in your area!</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:35:40', '2016-11-09 17:39:29'),
(98, 1, 'EDU2D-RW16', '<p>Hi [[FName]]!<br /><br />College is expensive.<br /><br />Agree or disagree?<br /><br />Here&rsquo;s the answer...<br /><br />College is expensive, BUT you can get free money to help you.<br /><br />Here&rsquo;s how:<br /><br /><span style="text-decoration: underline;"><strong>After selecting the college of your choice</strong></span>, ask the college Administration<br />about something called a Grant.<br /><br />What they&rsquo;ll be required to do if you qualify is directly fund $5,815 into your<br />checking account or give you the funds as a check.<br /><br />The great thing about a Grant is you never have to pay it back!<br /><br />The money is there for people like you who want to attend college.</p>\r\n<p><br />Wouldn&rsquo;t you like to take advantage of this?<br /><br />Of course you would!<br /><br />Get started now by clicking the link that says &ldquo;Take Advantage of This Now!&rdquo;<br />and following the instructions:</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>All the Best,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:36:51', '2016-11-09 17:40:22'),
(99, 1, 'EDU2D-RW17', '<p>Hi [[firstname]],<br /><br /><br />Here&rsquo;s a sneaky trick.<br /><br />What millions are students today to do get &ldquo;free&rdquo; rides to college is so simple and<br />so easy, this &ldquo;trick&rsquo; probably won&rsquo;t be around for much longer.<br /><br />Until it goes away, here&rsquo;s how to make money from it.<br /><br /><span style="text-decoration: underline;"><strong>Go here and select the college of your choice</strong></span><strong>.</strong> Once you go, you&rsquo;ll be given the<br />status of a student.<br /><br />This is a great thing because once you have the status of a student... you can get<br />$5,815 directly sent to you banking account (or in the form of a check) if you qualify.&nbsp; <br /><br />The even better thing about this Grant Fund is this:<br />you will never be required to pay the money back!<br /><br />So if you want to get paid to &ldquo;improve your future&rdquo;, follow the instructions in this<br />email to get $5,815 in funds sent to you as soon as you&rsquo;re given the status of a<br />student.<br /><br />Begin now by visiting the link below that says, &ldquo;Take Advantage of This Now!&rdquo;</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:39:35', '2016-11-09 17:41:14'),
(100, 1, 'EDU2D-RW18', '<p>EDU2D-RW18Hi [[firstname]],<br /><br />Here&rsquo;s a secret most don&rsquo;t know about yet...<br /><br />It&rsquo;s about what some people are doing to get $5,815<br />in Grant Funds, just for attending college.<br /><br />Here&rsquo;s how it works.<br /><br /><span style="text-decoration: underline;"><strong>After you visit this page and pick a college</strong></span>, request<br />help from the Administration department about<br />something called Grant Funds.<br /><br />If you apply and if and when you&rsquo;re accepted, you&rsquo;ll<br />receive $5,815 in Grant Funds to use as you wish.<br /><br />The cool thing is...<br />you will never be asked to pay the money back!<br /><br />We&rsquo;re not sure how much longer these Grant Funds<br />will be available.<br /><br />Rumor is laws are being rewritten as you read this...<br /><br />So if you want to take advantage of this &ldquo;secret&rdquo;...<br />AND get paid to go to college, visit the the link below<br />that says, &ldquo;Take Advantage of This Now!&rdquo;</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:40:57', '2016-11-09 17:41:43'),
(101, 1, 'EDU2D-RW19', '<p>Hey [[Fname]],<br /><br />So this is really cool...<br /><br />Hope you&rsquo;ve been well by the way. It&rsquo;s been awhile, hasn&rsquo;t it?<br /><br />What I just found out that I think would help you is this new program that provides $5,815<br /> in Grant Funds to help with college.<br /><br />It&rsquo;s SUPER simple to use this program.</p>\r\n<p><br />Then...<br /><br />Request help from the college&rsquo;s Administration Department by asking for something called<br />Grant Funds.<br /><br />If you do this, they are REQUIRED to help you receive $5,815* in Grant Funds to use as you<br />wish.<br /><br />The money comes as a CHECK or DIRECT DEPOSIT and you never have to pay it back!<br /><br />I read a story in the paper last week that said Grant Funds might be going away soon.<br /><br />So if I were you, I&rsquo;d stop whatever it is I was doing right now and take advantage of these<br />funds before they go away.<br /><br />Do this now...<br />Visit the the link below that says, &ldquo;Take Advantage of This Now!&rdquo;</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Take Advantage of This Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best of Luck!</p>\r\n<p>Alex</p>', NULL, '2016-09-29 11:42:14', '2016-11-09 17:42:12'),
(102, 1, 'EDU2D-RW20', '<p>[[FName]].<br /><br />Today, I got an amazing new opportunity to show you and a unique new &ldquo;trick&rdquo; for attending the college<br />of your dreams, even if you don&rsquo;t have a job or you don&rsquo;t have money for tuition.<br /><br />This is going to sound bizarre, but all you have to do is this:<br /><br />--&nbsp;&nbsp;&nbsp;&nbsp; Visit the link at the end of this email<br />--&nbsp;&nbsp;&nbsp;&nbsp; Choose which college you&rsquo;d like to attend<br />--&nbsp;&nbsp;&nbsp;&nbsp; Contact the college and ask for a &ldquo;Grant Fund&rdquo;<br /><br />The cool thing about &ldquo;Grant Funds&rdquo; is that if you qualify you can get $5,815 directly sent to you as a check<br />or direct deposit, and once it&rsquo;s in your bank account or you cash the check...</p>\r\n<p>You will never have the pay the money back!<br /><br />Now let me give you that link I told you about...<br /><br />Start &ldquo;step 1&rdquo; here:</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Apply In Mere Minutes (NOW!)</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best of luck,<br /><br />James Truman<br />Career Resource Officer</p>', NULL, '2016-09-29 11:43:58', '2016-11-09 17:42:39'),
(103, 3, 'CTS-2', '<p>Hi {FNAME},<br />&nbsp;<br />What are your thoughts on school?<br />&nbsp;<br />Let us look at the facts...<br />&nbsp;<br />A recent study revealed that most high school graduates earn less than 60% of<br />what those with bachelor\'s degrees earn.*<br />&nbsp;<br />In other words...<br />&nbsp;<br />Going to college can be the difference between making $60,000 and $100,000.<br />&nbsp;<br />Imagine what you could do with an extra $40,000 a year?<br />&nbsp;<br />You could buy a new car.<br />&nbsp;<br />Afford a nicer house.<br />&nbsp;<br />And be way less stressed.<br />&nbsp;<br />Sounds wonderful right?<br />&nbsp;<br />It gets better.<br />&nbsp;<br />Right now if eligible... you may be eligible to receive up to $5,815 to make your<br />college dreams happen!<br />&nbsp;<br />What is even more amazing is that if you qualify you will never have to pay the<br />money back.<br />&nbsp;<br />Once it is sent to you in a check or direct deposit, the money is yours to keep<br />forever.<br />&nbsp;<br />Since learning more about your financial aid eligibility only takes a minute, why<br />not spend a few moments to find out what schools you can potentially attend?</p>\r\n<p>You never know until you try and you might be pleasantly surprised.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style="text-decoration: underline;">Good News Could be Yours! (Go Here Now)!</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><br /><br />* http://www.bls.gov/emp/ep_chart_001.htm</p>', NULL, '2016-10-03 11:15:36', '2016-11-09 10:19:48'),
(104, 3, 'CTS-3', '<p>{FNAME},<br />&nbsp;<br />Phew.<br />&nbsp;<br />Thought you were dead.<br />&nbsp;<br />Happy you are alive and okay.<br />&nbsp;<br />Now for some good news...<br />&nbsp;<br />I am here to remind you that you may be eligible to apply<br />to receive grant money for school.<br />&nbsp;<br />The amount if awarded is $5,815 and it is given to you in<br />a check or you can have it direct deposited.<br />&nbsp;<br />The best part of this is none of the funds have to be paid<br />back.<br />&nbsp;<br />It only takes about a minute to check it out and find out<br />what schools you are potentially eligible for.<br />&nbsp;<br />Good Luck!</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Time is Limited&nbsp; Go Here Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 11:16:31', '2016-10-03 11:16:31'),
(105, 3, 'CTS-4', '<p>I spilled flour all over my kitchen this morning.</p>\r\n<p>I hate when that happens!<br />(Not sure why I brought that up?)<br /><br />Anyways, I am here to remind you that you may be<br />eligible to apply to receive grant money for school.<br />&nbsp;<br />The amount is $5,815 and it would be given to you in<br />a check or you can have it direct deposited.<br />&nbsp;<br />The best part of this is<br />none of the funds have to be paid back.<br />&nbsp;<br />It only takes about a minute to check it out and find<br />out what schools you are eligible for.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Click Here Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 11:18:01', '2016-11-09 10:28:11'),
(106, 3, 'CTS-5', '<p>Hello,<br />&nbsp;<br />Did you see what Kayne West did the other day?<br />&nbsp;<br />A bit silly if you ask me.</p>\r\n<p><br />Quick reminder:<br />&nbsp;<br />I am here to remind you that you may be eligible to apply to receive grant<br />money for school.<br />&nbsp;<br />The amount is $5,815 and it is given to you in a check or you can have it direct<br />deposited.<br />&nbsp;<br />The best part of this is none of the funds have to be paid back.<br /><strong>&nbsp;</strong><br />It only takes about a minute to check it out and find out what schools you are<br />eligible for.<br />&nbsp;<br /><br />Good Luck!</p>\r\n<p><span style="text-decoration: underline;"><strong><br />With Nothing to Lose Why not Take a Few Moments to See If You Qualify</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 11:20:04', '2016-11-09 10:28:40'),
(107, 3, 'CTS-6', '<p>&nbsp;<br />Good morning {FNAME},<br />&nbsp;<br />I just thought of something...<br />&nbsp;<br />Did you know right now you can receive up to $5,815 to go back to school,<br />right from the comfort of your own home?<br />&nbsp;<br />It\'s true.</p>\r\n<p><br />Here\'s how it works:<br />&nbsp;<br />Click the link at the bottom of this email once you\'re done reading these steps<br />Complete the quick request form (it takes 3-5 minutes)<br />Choose the subject of your choice and get matched with schools<br />&nbsp;<br />Pretty cool, right?</p>\r\n<p><br />The great thing about this is you\'ll never have to pay back the funds!<br />&nbsp;<br />Once the check in your name is in your account or you receive your direct<br />deposit, the funds are yours to use for your education.</p>\r\n<p>Why not take a few moments to find out which schools are available to you?<br /><br />Now here is the link I told you about for getting started:</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Go Here Now</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</p>', NULL, '2016-10-03 11:21:23', '2016-11-09 10:29:16'),
(108, 3, 'CTS-7', '<p>Hi {FNAME},<br />&nbsp;<br />What are your thoughts on school?<br />&nbsp;<br />Let us look at the facts...<br />&nbsp;<br />A recent study revealed high school graduates only earn about 60% of what<br />those with four-year degrees earn*.</p>\r\n<p><br />In other words...<br />&nbsp;<br />Going to college can be the difference between making $60,000 and $100,000.<br />&nbsp;<br />Imagine what you could do with an extra $40,000 a year?<br />&nbsp;<br />You could buy a new car.<br />&nbsp;<br />Afford a nicer house.<br />&nbsp;<br />And be way less stressed.<br />&nbsp;<br />Sounds wonderful right?<br />&nbsp;<br />It gets better.</p>\r\n<p><br />Right now if eligible... you can receive up to $5,815 per year to make your<br />college dreams happen!<br />&nbsp;<br />What is even more amazing is you will never have to pay the money back.<br />&nbsp;<br />Once it is sent to you in a check or direct deposit the money is yours to use for<br />your education.<br />&nbsp;<br />Since getting more information only takes a few minutes why not find out which<br />schools you can potentially attend?</p>\r\n<p>You never know until you try and you might be pleasantly surprised.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Confirm Your Eligibility Now!</strong></span><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br />* Sources:<br />https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br />http://www.bls.gov/emp/ep_chart_001.htm</p>', NULL, '2016-10-03 11:27:15', '2016-11-09 10:35:37'),
(109, 3, 'CTS-8', '<p>Hi {FNAME},<br />&nbsp;<br />What are your thoughts on school?<br />&nbsp;<br />Let us look at the facts...<br />&nbsp;<br />A recent study revealed high school graduates only earn about 60% of what<br />those with four-year degrees earn*.<br />&nbsp;<br />In other words...<br />&nbsp;<br />Going to college can be the difference between making $60,000 and $100,000.<br />&nbsp;<br />Imagine what you could do with an extra $40,000 a year?<br />&nbsp;<br />You could buy a new car.<br />&nbsp;<br />Afford a nicer house.<br />&nbsp;<br />And be way less stressed.<br />&nbsp;<br />Sounds wonderful right?<br />&nbsp;<br />It gets better.<br />&nbsp;<br />Right now if eligible... you can receive up to $5,815 per year to make your<br />college dreams happen!<br />&nbsp;<br />What is even more amazing is you will never have to pay the money back.<br />&nbsp;<br />Once it is sent to you in a check or direct deposit the money is yours to use for<br />your education.<br />&nbsp;<br />Since getting more information only takes a few minutes why not find out which<br />schools you can potentially attend?</p>\r\n<p>You never know until you try and you might be pleasantly surprised.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Confirm Your Eligibility Now!</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br />* Sources:<br />https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br />http://www.bls.gov/emp/ep_chart_001.htm</p>', NULL, '2016-10-03 11:30:21', '2016-10-03 11:30:21'),
(110, 3, 'CTS-9', '<p>Crazy news...<br />&nbsp;<br />Was at Target today and I saw the strangest thing happen.<br />&nbsp;<br />A woman got arrested for stealing cookie dough.<br />&nbsp;<br />She, um, tried to hide it in place that is... off limits.<br />&nbsp;<br />But what happened was she got caught because the can of<br />cookie dough exploded from being there too long.</p>\r\n<p><br />Anyway...<br />&nbsp;<br />I am here to remind you that you may be eligible to receive<br />grant money for school.<br />&nbsp;<br />The amount is up to $5,815 and it is given to you in a check<br />or you can have it direct deposited.<br />&nbsp;<br />The best part of this is none of the funds have to be paid<strong><br /></strong>back.<br /><br />It only takes a few minutes to check out and find out which<br />schools are available to you.</p>\r\n<p><br /><strong><span style="text-decoration: underline;">CLICK HERE NOW!</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</p>', NULL, '2016-10-03 11:31:24', '2016-11-09 10:37:10'),
(111, 3, 'CTS-10', '<p>This email is for uncommitted men only...<br />&nbsp;<br />You know what they say about college girls, right?<br />&nbsp;<br />That no matter how old you are, college girls<br />always stay the same age.<br />&nbsp;<br />I feel weird telling you this...<br />&nbsp;<br />But I know a lot of men who do this one trick to<br />meet younger women.<br />&nbsp;<br />What they do is apply for grants and attend<br />community college for free.<br />&nbsp;<br />Then... because of their age, they end up dating a<br />lot of younger women.<br />&nbsp;<br />Girls LOVE older men...<br />&nbsp;<br />So if you are a man age 24+...</p>\r\n<p><br />I am here to remind you that you may be eligible<br />to receive grant money for school.<br /><strong>&nbsp;</strong><br />The amount is up to $5,815 and it is given to you<br />in a check or you can have it direct deposited.<br />&nbsp;<br />The best part of this is none of the funds have to<br />be paid back.<br />&nbsp;<br />It only takes a few minutes to check out and find<br />out which schools are available to you.<br />&nbsp;<br />Good Luck!</p>\r\n<p><span style="text-decoration: underline;"><br /><strong>Go Here Now</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br />Sincerely,</p>\r\n<p>Alex</p>\r\n<p>&nbsp;</p>\r\n<p><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</p>', NULL, '2016-10-03 11:33:05', '2016-11-09 10:37:41'),
(112, 3, 'CTS-11', '<p>Hello.<br />&nbsp;<br />Do you have a favorite type of pie?<br />&nbsp;<br />My favorite pie is peach.<br />&nbsp;<br />Mmm...<br />&nbsp;<br />Warm peach pie with French vanilla ice cream.<br />&nbsp;<br />Amazingly delicious!<br />&nbsp;<br />What is your favorite?<br />&nbsp;<br />(Or maybe you are a cake person?)</p>\r\n<p><br />By the way...<br />&nbsp;<br />I am here to remind you that you may be eligible<br />to receive grant money for school.<br />&nbsp;<br />The amount is up to $5,815 and it is given to you<br />in a check or you can have it direct deposited.<br />&nbsp;<br />The best part of this is none of the funds have to<br />be paid back.<br />&nbsp;<br />It only takes a few minutes to check out and find<br />out which schools are available to you.</p>\r\n<p><br /><strong><span style="text-decoration: underline;">Act Now!</span></strong><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>\r\n<p><br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</p>', NULL, '2016-10-03 11:35:14', '2016-11-09 10:38:03'),
(113, 4, 'WL-1', '<p>Hi [[fname]],<br /><br /><br />Are you interested in earning your degree?&nbsp;You may be eligible to receive grant funds&nbsp;<br />for schooling.&nbsp;If so, we can help you get approved and get matched with&nbsp;accredited schools.<br /><br />In mere minutes we can assist you with choosing your school match&nbsp;and filling out a&nbsp;financial aid <br />questionnaire. It costs nothing and is very quick and easy to do.<br /><br /><br /><span style="text-decoration: underline;">Click here now to get matched with schools<br /><br /></span></p>\r\n<p><br />Once again, this costs nothing and will only take a few minutes of&nbsp;your time.&nbsp;Why not<br /> find out more now?</p>\r\n<p>&nbsp;<br /><br />Sincerely,<br /><br />Alex<br /><br /><br /></p>\r\n<p>Should you no longer wish to receive our emails, please visit <span style="text-decoration: underline;">here</span><br />(http://degreesearch.org/unsubscribe) to unsubscribe,<br />or write to: 28100 US Hwy 19, Ste. 204, Clearwater, FL 33761</p>', NULL, '2016-10-03 11:50:18', '2016-10-14 11:14:48'),
(114, 4, 'WL-2', '<p>Hi [[fname]],<br /><br /><br />Hope your day is going great - and if it&rsquo;s not, let&rsquo;s see if we can make it a little better.&nbsp;You<br /> are now able to get matched to schools. And you may qualify for financial aid upon<br />applying for aid using the the FAFSA form (Free Application for Federal Student Aid).<br /><br />This process costs nothing and will only take a few minutes of your time.&nbsp;Why not take<br /> a few minutes and get matched with schools?<br /><br /><br /><span style="text-decoration: underline;">Click here now.<br /></span><br /><br />Once again, this costs nothing and you could potentially receive aid to help pay your<br />tuition and fees.&nbsp;Take advantage of this service.</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,<br /><br />Alex</p>\r\n<p>&nbsp;</p>\r\n<p>Should you no longer wish to receive our emails, please visit <span style="text-decoration: underline;">here</span><br />(http://degreesearch.org/unsubscribe) to unsubscribe,<br />or write to: 28100 US Hwy 19, Ste. 204, Clearwater, FL 33761</p>', NULL, '2016-10-03 11:51:47', '2016-10-14 11:14:16'),
(115, 4, 'WL-3', '<p>Hi [[fname]],<br /><br /><br />There has never been a better time to go back to school.&nbsp;Grants of up to $5,815* are<br />now available per year to those that qualify.<br /><br />In just 2 minutes get matched to schools that fit your needs and goals.</p>\r\n<p><span style="text-decoration: underline;"><br />Click Here Now<br /></span><br /><br />This costs nothing and only takes a few minutes of your time.&nbsp;Take advantage of this <br />opportunity.<br /><br /><br /></p>\r\n<p>Sincerely,<br /><br />Alex</p>\r\n<p>&nbsp;<br /><br />*https://studentaid.ed.gov/types/grants-scholarships/pell<br /><br /><br />Should you no longer wish to receive our emails, please visit <span style="text-decoration: underline;">here</span><br />(http://degreesearch.org/unsubscribe) to unsubscribe,<br />or write to: 28100 US Hwy 19, Ste. 204, Clearwater, FL 33761</p>', NULL, '2016-10-03 11:52:55', '2016-10-14 11:16:20'),
(116, 4, 'WL-4', '<p>Hi [[fname]],<br /><br /><br />I have some good news for you!&nbsp;You can get matched to schools that fit your needs and<br /> goals,&nbsp;and you may qualify for a grant of up to $5,815* to return to&nbsp;school.</p>\r\n<p><span style="text-decoration: underline;"><br />Take 2 minutes to get matched<br /></span><br /><br />This costs nothing and will only take a moment of your time&nbsp;Why not take a sec&nbsp;to find<br /> out your options?</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,<br /><br />Alex</p>\r\n<p>&nbsp;</p>\r\n<p>*https://studentaid.ed.gov/types/grants-scholarships/pell<br /><br /></p>\r\n<p>Should you no longer wish to receive our emails, please visit <span style="text-decoration: underline;">here</span><br />(http://degreesearch.org/unsubscribe) to unsubscribe,<br />or write to: 28100 US Hwy 19, Ste. 204, Clearwater, FL 33761</p>', NULL, '2016-10-03 11:54:32', '2016-10-14 11:21:18'),
(117, 5, 'CCU-1', '<p>Hi [[firstname]],<br /><br />As someone who is interested in furthering their education we wanted to let you know<br />that there are over one thousand Federal programs potentially available to you to help<br />people like yourself get a government grant for use with furthering their education.&nbsp;&nbsp;</p>\r\n<p><br />Good news!</p>\r\n<p>Our records indicate that you may have been pre-approved to apply to prestigious<br />Colorado Christian University.<br /><br />You may also meet the qualifying criteria of applying for funding for yourself.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Please go here now to confirm your funding application opportunity and your chance<br />to attend one of the nation&rsquo;s best schools.</strong></span><br /><br />This will only take a few minutes of your time and costs nothing.</p>\r\n<p>Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 11:58:33', '2016-11-09 10:17:01'),
(118, 5, 'CCU-2', '<p>Hi [[firstname]],<br /><br />&nbsp;As someone who has shown interest previously in matters of this nature this<br />is something that will surely interest you.</p>\r\n<p>During the last allocation period we have helped connect thousands people<br />like yourself with financial aid and schools that will accept funding of this nature.</p>\r\n<p>According to our records you may meet the requirements of qualifying for aid for<br />the purposes of obtaining a higher education.</p>\r\n<p>You may also be eligible to apply to attend prestigious Colorado Christian University.</p>\r\n<p><span style="text-decoration: underline;"><strong><br />Please go here now to confirm your qualification.</strong></span><br /><br />This process is extremely simple and will only take a few minutes of your time.</p>\r\n<p>Be sure to take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>All the best,<br /><br />Alex</p>', NULL, '2016-10-03 12:02:00', '2016-11-09 10:17:22'),
(119, 5, 'CCU-3', '<p>Hi [[firstname]],<br /><br />According to our records you may meet the eligibility requirements<br />of application to prestigious Colorado Christian University.</p>\r\n<p><strong><span style="text-decoration: underline;">Please go here now to confirm your eligibility.</span></strong><br /><br />Federal aid may be available to you as well.</p>\r\n<p>Act now while this is still available to you.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,<br /><br />Alex</p>', NULL, '2016-10-03 12:02:54', '2016-11-09 10:40:39'),
(120, 5, 'CCU-4', '<p>Hi [[firstname]],<br /><br />According to our records you may meet the eligibility requirements<br />for application to prestigious Colorado Christian University.&nbsp;</p>\r\n<p><strong><span style="text-decoration: underline;">Please confirm your eligibility now by going here.</span></strong><br /><br />This will only take a few moments of your time.</p>\r\n<p>Funding to help pay for your schooling needs may also be available<br />to you.</p>\r\n<p>Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best of luck,<br /><br />Alex</p>', NULL, '2016-10-03 12:03:35', '2016-11-09 10:41:55'),
(121, 5, 'CCU-5', '<p>Hi [[firstname]],<br /><br />We have some good news for you!&nbsp; You may be eligible to apply to<br />renowned  INSERT INTO `creatives` (`creative_id`, `offer_id`, `creative_code`, `creative`, `creative_tags`, `creative_created`, `creative_edited`) VALUES
(134, 7, 'LB-7', '<p>Hi [[firstname]],<br /><br /><br />Since 1971, Liberty&rsquo;s mission as a university has been to provide a&nbsp;world-class <br />educational experience with a solid Christian foundation&nbsp;to equip men and women with<br /> the values, knowledge, and skills&nbsp;essential for success in every aspect of life.</p>\r\n<p>Currently, Liberty has some of the highest retention and graduation&nbsp;rates of any leading <br />online university.</p>\r\n<p><br />Good news!&nbsp;According to our records you are eligible to apply to attend<br />Liberty University. Take advantage of this opportunity now --&nbsp;<span style="text-decoration: underline;"><strong>Click here!</strong><br /><br /></span></p>\r\n<p>Financial aid may also be available to help with schooling.&nbsp;A rewarding future awaits<br />you -- act now!</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:13:21', '2016-11-09 10:54:28'),
(135, 7, 'LB-8', '<p>Hi [[firstname]],<br /><br /><br />Liberty university is consistently rated as one of the top distance educators&nbsp;in the<br /> nation, and known for its affordability and exceptional&nbsp;student support. It maintains <br />high student satisfaction&nbsp;as well as impressive retention and graduation rates.</p>\r\n<p>Great news!&nbsp;According to our records you are eligible to apply to attend&nbsp;Liberty <br />University. Take advantage of this opportunity now --&nbsp;<span style="text-decoration: underline;"><strong>Click here now!</strong><br /><br /></span></p>\r\n<p>Financial aid may also be available to help with schooling.&nbsp;Act now&nbsp;to get started on<br />your education!</p>\r\n<p>Currently, Liberty has some of the highest retention and&nbsp;graduation rates of any leading online university.<br />A rewarding future awaits you!<br /><br /><br /></p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:15:02', '2016-11-09 10:54:46'),
(136, 7, 'LB-9', '<p>Hi [[firstname]],<br /><br /><br />Liberty University offers more than 500 degrees and certificates online&nbsp;and on campus<br /> in areas the market demands most, including business,&nbsp;counseling, criminal justice,<br />education, nursing and&nbsp;psychology to name a few.</p>\r\n<p>Great news!&nbsp;According to our records you are eligible to apply to attend Liberty <br />University. Take advantage of this opportunity now --&nbsp;<span style="text-decoration: underline;"><strong>Click here!</strong><br /><br /></span></p>\r\n<p>Financial aid may also be available to help with schooling. Act now to get started on <br />your education!</p>\r\n<p><br /><br />Liberty University\'s tuition rates are among the lowest of universities offering&nbsp;<br />online programs and it is consistently rated as one of the top distance educators&nbsp;in the nation.</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-03 14:21:41', '2016-11-09 10:55:32'),
(137, 7, 'LB-10', '<p>Among the first &mdash; and the best<br />Since 1971, Liberty&rsquo;s mission as a university has been to provide a world-class educational<br />experience with a solid Christian foundation to equip men and women with the values,<br />knowledge, and skills essential for success in every aspect of life.<br /><br />Currently, Liberty has some of the highest retention and graduation rates of any leading<br />online university.</p>\r\n<p>&nbsp;</p>\r\n<p>Supported by a residential campus<br />Liberty has maintained its mission of Training Champions for Christ and continually nurtures<br />an environment of academic excellence, technological innovation, and commitment to Christian<br />values.<br />Given a unique opportunity to recreate the campus with a single architectural vision, Liberty is<br />building excellence from the ground up. A recent $500 million campus upgrade demonstrates a<br />commitment to providing students with state-of-the-art technology and hands-on learning<br />opportunities.</p>\r\n<p>As an extension of Liberty&rsquo;s Lynchburg, Va.-based campus, online courses allow students to<br />enjoy the same quality course offerings as Liberty&rsquo;s residential students, but with additional<br />flexibility. <br /><br />Career-ready degrees <br />Liberty University offers more than 500 degrees and certificates online and on campus in<br />areas the market demands most, including business, counseling, criminal justice, education,<br />nursing, psychology, and religion.</p>\r\n<p>Christian Foundation<br />All courses are taught from a Christian worldview by professors who regard teaching as more<br />than a job &mdash; it&rsquo;s their calling.</p>\r\n<p>Liberty&rsquo;s mission of Training Champions for Christ challenges students to think critically and<br />creatively, becoming men and women of character who will make a positive difference in their<br />communities and in the world.</p>\r\n<p>More affordable <br />Liberty University\'s tuition rates are among the lowest of universities offering online programs.</p>\r\n<p>Consistently rated as one of the top distance educators in the nation, and known for its<br />affordability and exceptional student support, Liberty maintains high student satisfaction as<br />well as impressive retention and graduation rates.</p>\r\n<p>Our students succeed<br />With a low student-to-professor ratio and caring Christian faculty who are invested in individual<br />student success, Liberty fosters an environment in which students are challenged to do their<br />best while celebrating the talents and gifts God has given them.</p>\r\n<p>Over 250,000 Liberty alumni are influencing the world in their respective careers.</p>\r\n<p>Flexible learning format<br />Invest in your education and reach your full potential while focusing on Christ.<br />Earn your degree as you balance family, work, ministry, and life\'s other demands.</p>\r\n<p>Liberty University&rsquo;s online format offers a flexible schedule, which allows you to choose when<br />and where you study, completing your degree at your own pace.</p>\r\n<p>Generous military benefits <br />With a military community of over 30,000 members enrolled in online courses, Liberty University<br />is proud to honor the men and women who serve our country. Service members, veterans, and<br />their spouses enjoy generous benefits including tuition discounts, free Book Vouchers, fee<br />waivers, and credit for military training.&nbsp;</p>\r\n<p>Trusted support network<br />Liberty University students also benefit from individualized attention thanks to low<br />tudent-to-professor ratios.<br /><br />Students receive free support services and resources to help them succeed, including tutoring<br />services, the Online Writing Center, Career Center, Online Communities, and academic advisors<br />who are dedicated to student success.</p>\r\n<p><br /><strong><span style="text-decoration: underline;">Become a Champion for Christ!</span></strong><br /><strong><span style="text-decoration: underline;">With a degree from Liberty University, you can start achieving your goals.</span></strong></p>\r\n<p><strong><span style="text-decoration: underline;">Learn more!</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Best Wishes,</p>\r\n<p>Alex</p>', NULL, '2016-10-03 14:43:21', '2016-11-09 10:57:03'),
(138, 8, 'CC-1', '<p>Good afternoon [[FName]],<br /><br />I hope you are enjoying your {{Dayofweek}}...Quick reminder...<br /><br />Earn your degree and you may be eligible to receive grant funds for school.<br /><br />The amount is up to $5,815*.<br /><br />It only takes a minute to get matched with schools and learn more about degree<br />programs and financial aid opportunities. &nbsp;<br /><br /><span style="text-decoration: underline;"><strong>--&gt; Go Here Now &larr;</strong></span><br /><br /><span style="text-decoration: underline;">* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</span></p>', NULL, '2016-10-03 14:46:49', '2016-11-09 10:59:42'),
(139, 8, 'CC-2', '<p>Hey {{Fname}}, I hope this message finds you in time.<br /><br />I just wanted to let you know I\'ve got some great news for you.<br /><br />College graduates are in high demand.<br />Grant funding is available for college<br />and you may be eligible to receive some.<br /><br />The amount you could receive is up to $5,815*.<br /><br />You can use these funds for online courses. Graduates with higher degree levels<br />consistently have higher salaries and lower unemployment rates**. <br /><br />The best part is these grants don&rsquo;t have to be paid back.<br /><br /><span style="text-decoration: underline;"><strong>--&gt; Go Here Now to Get Started &lt;---</strong></span><br /><br />It only takes a minute to learn more about this opportunity. &nbsp;<br /><br />Thank you, <br /><br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br />** http://www.bls.gov/emp/ep_chart_001.htm<br /><br /></p>', NULL, '2016-10-03 14:49:35', '2016-11-07 14:48:56'),
(140, 8, 'CC-3', '<p>Hey {{Fname}},<br /><br />Still thinking about going to college?<br /><br />If you are undecided, that&rsquo;s okay. Just know that when you&rsquo;re ready, you may<br />qualify for up to $5,815* in grant funding for college (if you qualify &mdash; learn<br />more by reading this email).<br /><br />Unlike loans, these grants are yours to keep forever. This means you will never<br />be asked to pay them back. <br /><br />That sounds awesome, right?<br /><br />If you qualify, you can use the $5,815 for online classes. Finding schools and<br />getting more information about this opportunity only takes a few minutes,<br />tops.<br /><br />Just answer a few simple questions to get started.<br /><br />Good luck!<br /><br /><span style="text-decoration: underline;"><strong>&rarr; Want to Learn More? Go Here Now &larr;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,<br />Alex</p>', NULL, '2016-10-03 14:53:48', '2016-11-07 14:50:10'),
(141, 8, 'CC-4', '<p>Hey {{Fname}},<br /><br />Still thinking about going to college?<br /><br />Did you know that you may be entitled to up to $5,815* in funding for college?<br /><br />Most people are unaware of opportunities being provided to Americans who<br />cannot afford an education.<br /><br />It only takes a few minutes to find schools and learn more about this<br />opportunity. <br /><br />Pretty awesome, right?<br /><br />You can even use the grant money for online classes, so you can get an<br />education on your own schedule. <br /><br />Like I said, it just takes a minute to get started.<br /><br />Have a great day.<br /><br />And an even greater week!<br /><br /><span style="text-decoration: underline;"><strong>&rarr; Want to Learn More? Go Here Now &larr;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,<br />Alex<br /><br />P.S. If you are skeptical about this, I understand. <br /><br />P.P.S. Opportunities may be available for new and returning qualified students,<br />visit the following link to get matched with schools.<br /><br />Go here to get more information (it&rsquo;s doesn&rsquo;t cost anything)<br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell<br /><br /></p>', NULL, '2016-10-03 15:20:48', '2016-11-07 15:13:15'),
(142, 8, 'CC-5', '<p>Hey {{Fname}},<br /><br />College graduates are in high demand. Are you ready to prepare for a career? <br /><br />Right now up to $5,815* a year is available to new and returning qualified<br />students.<br /><br />Learning more about this great opportunity is simple. We&rsquo;ve outline how to get<br />it in 3 steps.<br /><br />Visit the URL at the end of this email after reading these steps<br />Answer the simple questions it asks you (it will take you 2 minutes, tops)<br />Speak to an enrollmentcounselor about degrees and the financial aid you may<br />qualify for.<br /><br />Another thing people like about this is you can use the money for online<br />classes. This means you can get an education, without regularly driving to and<br />from campus.<br /><br />Ready for the URL now?<br /><br />Here you go...<br /><br /><span style="text-decoration: underline;"><strong>&rarr; Want to Learn More? Go Here Now &larr;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,<br />Alex</p>\r\n<p>P.S. If you are skeptical about this, I understand. <br /><br />P.P.S. Opportunities may be available for new and returning qualified students,<br />visit the following link to get matched with schools.<br /><br />Go here to get more information (there is no cost)<br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell</p>', NULL, '2016-10-03 15:28:02', '2016-11-07 15:14:12'),
(143, 8, 'CC-6', '<p>Hey {{Fname}},<br /><br />There&rsquo;s a popular saying that goes like this.<br /><br />The more you learn, the more you _____.<br /><br />Can you guess the answer?<br /><br />We&rsquo;ll help you out, if you&rsquo;re stumped.<br /><br />Just give this a try on your own, first.<br /><br />(Scroll down for answer.)<br /><br />.<br /><br />.<br /><br />.<br /><br />.<br /><br />Okay. <br /><br />Ready for the answer?<br /><br />Here you go.<br /><br />The more you learn, the more you earn**.<br /><br />It&rsquo;s true. <br /><br />The more you learn, the more money you earn. The problem is people these<br />days are struggling with paying for their education. Perhaps you are one of<br />these people who&rsquo;re struggling to make ends meet.<br /><br />If you are, then I&rsquo;ve got great news for you!<br /><br />Up to $5,815* in college funding is available to new and returning students<br />who qualify for help.<br /><br />Learning more about this great opportunity takes about two minutes, tops. I&rsquo;ve<br />included where you can get matched with schools and learn more about<br />financial aid options at the end of this email.<br /><br />Another benefit of this grant money is you can use it for online classes. Which<br />is great for you if you have a busy schedule.<br /><br />Like I said, it only takes a few minutes to find schools and get more<br />information about financial aid.<br /><br />Here is the link I promised you: <br /><br /><span style="text-decoration: underline;"><strong>&rarr; Want to Learn More? Go Here Now &larr;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,<br />Alex<br /><br />P.S. If you are skeptical about this, I understand. <br /><br />P.P.S. Opportunities may be available for new and returning qualified students,<br />visit the following link to get matched with schools.<br /><br />Go here to get more information (there is no cost)<br /><br />* https://studentaid.ed.gov/sa/types/grants-scholarships/pell