(167, 19, 'HW-3', '<p>Attention: Homeowners!</p>\r\n<p>{firstname} - Are You Ready To Never Pay For Covered Home Repairs Again!<br />Say goodbye to worrying because life can\'t get much better than this.</p>\r\n<p>With a 24/7 claims hotline to make sure that you\'re covered systems always<br />get the necessary TLC.<br />Have a heating system that breaks down in winter, or an oven that won\'t<br />seem to work right before your holiday meal?</p>\r\n<p>Simply click below and submit your information to get an incredible<br />Home Warranty Quote.<br /><br />Protect your home and get peace of mind so you can focus on the things in<br />life that really matter!</p>\r\n<p><br /><span style="text-decoration: underline;">Click Here Now!</span><br />&nbsp;<br />Reply back and let us if you know if this provides you peace of mind!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-10-11 13:18:31', '2016-10-11 13:18:31'),
(168, 19, 'HW-4', '<p>It\'s going to be a Long, HOT Summer.</p>\r\n<p><br />What if your home systems, Cooling, Heating or<br />appliances breakdown?<br /><br />Top Reasons to get a - Home Warranty quote:<br /><br />FIRST MONTH F-R-E-E<br /><br />-&nbsp; Cooling, Heating &amp; Electrical<br />-&nbsp; Plumbing and Water Heaters<br />-&nbsp; Kitchen and Laundry Appliances.<br />-&nbsp; Almost all other Home Repairs<br />-&nbsp; Local, Pre-screened technicians<br />-&nbsp; 24/7 Claims Service</p>\r\n<p><br /><span style="text-decoration: underline;">Get your F-r-e-e Month Here</span><br /><br /><br />* With purchase of any single payment home warranty plan.<br />All Choice Home Warranty plans subject to terms &amp; conditions.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-11 13:21:29', '2016-10-11 13:21:29'),
