(171, 19, 'HW-7 (HTML)', '<table id="Table_01" border="0" width="550" cellspacing="0" cellpadding="0" align="Center">\r\n<tbody>\r\n<tr>\r\n<td colspan="2">\r\n<div style="text-align: center;"><a href="http://echo7.bluehornet.com/ct/46622748:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r:68"><span style="font-size: 14px;"><span style="font-family: Verdana;">Avoid the Hassles of Home Repair</span></span></a></div>\r\n<a href="http://echo7.bluehornet.com/ct/46622748:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r:68"><img src="https://echo7.bluehornet.com/cimages/a99690e42710d274b27f5b3ac0e1a9a6/CHW-Email-01_01.gif" alt="" width="550" height="397" border="0" /></a></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><a href="http://echo7.bluehornet.com/ct/46622748:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r:68"><img src="https://echo7.bluehornet.com/cimages/a99690e42710d274b27f5b3ac0e1a9a6/CHW-Email-01_02.gif" alt="" width="550" height="55" border="0" /></a></td>\r\n</tr>\r\n<tr>\r\n<td><a href="http://echo7.bluehornet.com/ct/46622748:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r:68"><img src="https://echo7.bluehornet.com/cimages/a99690e42710d274b27f5b3ac0e1a9a6/CHW-Email-01_03.gif" alt="" width="196" height="102" border="0" /></a></td>\r\n<td><a href="http://echo7.bluehornet.com/ct/46622748:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r:68"><img src="https://echo7.bluehornet.com/cimages/a99690e42710d274b27f5b3ac0e1a9a6/CHW-Email-01_04.gif" alt="" width="354" height="102" border="0" /></a></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2" bgcolor="#FFFFFF" width="550" height="226">\r\n<p style="text-align: left; color: black; font-size: 11px; font-weight: bold;">All Choice Home Warranty plans are subject to terms and conditions</p>\r\n<span style="font-family: arial; font-size: xx-small;">A home warranty is a renewable service contract that covers the repair or replacement of many of the most frequently occurring breakdowns of system components and appliances. Your home is most likely one of your biggest investments. Unexpected repair or replacement costs of covered items can easily strain your budget. Plus, finding a qualified professional to solve your problems can be stressful and inconvenient.<br /> <br /> Choice Home Warranty plans offer comprehensive protection against the high cost of repair or replacement of properly maintained major systems and appliances. A policy holder calls our claims center and pays a modest service call fee per claim when a problem or repair need arises. At Choice Home Warranty, we strive to always offer our customers fast and simple solutions, along with excellent service technicians. Customers are looking for value for their money, and we believe we provide outstanding customer satisfaction and protection against the high costs of home and appliance repairs on covered items.*<br /> <br /> *First month free with purchase of any single payment home warranty plan<br /> <br /> When you decide to purchase a Choice Home Warranty, you will work with a knowledgeable, dedicated team that will service your covered home repair needs swiftly and efficiently.** With many home warranty companies, your claim is assigned to a clerk in a large department, rather than having a personable, dedicated team processing your service request. With a CHW Warranty, you will have a dedicated team of two or three representatives, who will always be thoroughly involved in your claim and available to help you with any questions that your may have.</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style="text-align: center;"><br />To stop receiving messages, please visit <a href="http://echo7.bluehornet.com/ct/46622749:6Pru9grNi:m:1:1846701117:1947152D7015889C50AEC2759BAADD89:r">here</a>.<br /> or write to us at: 1090 King Georges Post Rd Edison NJ 08837</div>', NULL, '2016-10-11 13:37:52', '2016-10-11 13:37:52'),
(172, 19, 'HW-9 (HTML)', '<p>If you&rsquo;re still paying for your own home repairs, it&rsquo;s imperative you <span style="text-decoration: underline;">check this out.</span><br /><br />For a select time you can now get a first month, no cost warranty that allows you<br />to never pay for home repairs again.<br /><br />This new plan covers everything below:<br /><br />-&nbsp; Air Conditioning System<br />-&nbsp; Heating System<br />-&nbsp; Electrical System<br />-&nbsp; Plumbing System<br />-&nbsp; Water Heater<br />-&nbsp; Plumbing Stoppages<br />-&nbsp; Refrigerator<br />-&nbsp; Oven<br />-&nbsp; Stove<br />-&nbsp; Cook Top<br />-&nbsp; Microwave<br />-&nbsp; Dishwasher<br />-&nbsp; Clothes Washer<br />-&nbsp; Clothes Dryer<br />-&nbsp; Garbage Disposals<br />-&nbsp; Garage Opener<br />-&nbsp; Ceiling Fans<br />-&nbsp; Duct work</p>\r\n<p><span style="text-decoration: underline;"><br />Limited time, First Month Doesn&rsquo;t Cost Anything* </span><br /><br /><span style="text-decoration: underline;">Time is Limited&nbsp; Go Here Now!</span><br /><br /><br />*with Purchase of any single payment home warranty plan.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-11 13:46:36', '2016-10-11 13:46:36'),
