(176, 19, 'HW-14', '<p>Hey [[firstname]],<br /><br />Hope things are amazing in your part of the world.<br /><br />If they aren&rsquo;t here is something that should brighten up<br />your day.<br /><br />It&rsquo;s an awesome way of not having to worry about paying<br />for those crappy home repair expenses ever again.<br /><br />It costs you nothing for the first month and you can get<br />100% of all repairs for the following covered for your home.</p>\r\n<p><br />Water-Heater<br />All Electrical Repairs<br />AirConditioning<br />Plumbing<br />Stove/Oven<br />Microwaves/Dishwashers<br />Fridges<br />Washer/Dryers<br />Garbage-Disposals<br />Garage-Openers<br />Ceiling fans/duct work<br />And much much more<br /><br />This offer is not going to last forever - I would strongly<br />suggest that you check it out before it&rsquo;s too late.</p>\r\n<p><br />Discover more about this here:<br /><br /><span style="text-decoration: underline;">CLICK HERE NOW!</span></p>', NULL, '2016-10-11 13:50:45', '2016-10-11 13:50:45'),
(177, 19, 'HW-15', '<p>Hello [[firstname]],<br /><br />Hope your day is going great!<br /><br />A quick message about something that you should take note of.<br /><br />It&rsquo;s a new way for you to benefit from never having to take funds out of<br />your own pocket for home repairs ever again.<br /><br />Initially it costs nothing and allows you 100% coverage on the following:<br /><br />- AirConditioning-System<br />- Heating-System<br />- Electrical-System<br />- Plumbing-System<br />- Water-Heater<br />- Plumbing-Stoppages<br />- Refrigerator<br />- Oven<br />- Stove<br />- Cook-Top<br />- Microwave<br />- Dishwasher<br />- Clothes-Washer<br />- Clothes-Dryer<br />- Garbage-Disposals<br />- Garage-Opener<br />- Ceiling-Fans<br />- Duct-work<br /><br />This is only here for a little while longer so I would take advantage of this<br />while you still can.</p>\r\n<p><span style="text-decoration: underline;"><br />This Is a Limited Time Opportunity CLICK HERE Now!</span></p>', NULL, '2016-10-11 13:51:44', '2016-10-11 13:51:44'),
