(180, 19, 'HW-18', '<p>FILE:&nbsp; HW-101919<br /><br />Hello {firstname},</p>\r\n<p><br />We are happy to present you with a F-R-E-E<br />Home Warranty.<br /><br /><br /><span style="text-decoration: underline;">Take advantage of this while you still can.</span><br /><br /><span style="text-decoration: underline;">Click Here NOW - TIME IS LIMITED</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-11 13:56:04', '2016-10-11 13:56:04');
