(198, 12, 'RF-1', '<p>Re: Case#&nbsp;ALA-63892<br /><br />Your account history was recently reviewed and it has been determined that you meet <br />the eligibility requirements for the Home Affordable Refinance Program.<br /><br /><span style="text-decoration: underline;">Please take a few minutes of your time and apply here now.</span></p>\r\n<p>Traditional requirements have recently been waived and it is now easier for <br />homeowners to qualify for lower rates and more affordable loans.</p>\r\n<p><br />Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,<br /><br />Jason Prescott<br />HCA</p>', NULL, '2016-10-11 14:23:03', '2016-11-11 05:07:11'),
(199, 12, 'RF-2', '<p>Re: Policy#&nbsp;LC-A1908A</p>\r\n<p><br />Your home owner status was recently reviewed and it has been determined that you meet <br />the eligibility requirements for the Home Affordable Refinance Initiative.<br /><br /><span style="text-decoration: underline;">Please take a couple of minutes to confirm your eligibility.</span><br /><br />Recent regulatory requirements have been adjusted and it is now much easier for <br />homeowners to qualify for lower rates and more economical loans.<br /><br />Take advantage of this while you still can.</p>\r\n<p>Kind Regards,<br /><br />Jason Prescott<br />HCA</p>', NULL, '2016-10-11 14:24:20', '2016-11-11 05:10:11'),
(200, 12, 'RF-5', '<p>Owe more than your home is worth?<br />Want to reduce your interest rate?<br />Need to lower your payment?<br />President Obama announces affordable refinance programs<br /><span style="text-decoration: underline;">Find out if you qualify for these programs<br /></span>President Obama responds to growing concerns about thenations battered housing <br />market by unveiling a plan to help reduce the monthly mortgage payments.</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-11 14:28:15', '2016-11-11 05:12:00'),
