(213, 12, 'RF-22A', '<p>Hey %%firstname%%, <br /><br />Just a quick heads up...<br /><br />The President just announced his HARP 2.0 mortgage program and it\'s saving<br />homeowners everywhere on their mortgage.<br /><br />I emailed you today because our records indicate that you may qualify...<br /><br /><span style="text-decoration: underline;">Confirm your qualification here</span><br /><br />This has the potential to make an enormous difference in your monthly bill.<br />Take advantage of this while you still can.</p>\r\n<p>Best Wishes,</p>\r\n<p>Alex</p>', NULL, '2016-10-11 14:48:39', '2016-11-11 05:25:12'),
(214, 12, 'RF-33A', '<p>Hi {firstname},<br /><br />I know that you&rsquo;ve heard it before, but this may really be your last chance to <br />Refinance before rates go way, way up! <br /><br />Recently the Fed raised rates for the first time in almost a decade, and they&rsquo;re <br />expected to go up again any day now. <br /><br />So, if you haven&rsquo;t checked on your loan, this is truly your last chance at near <br />record-low rates. <br /><br />Check how much you can save by tapping on your Current Loan Balance:</p>\r\n<p><span style="text-decoration: underline;">&gt; Under 100k</span><br /><span style="text-decoration: underline;">&gt; 100k - 250k</span><br /><span style="text-decoration: underline;">&gt; 250k - 400k</span><br /><span style="text-decoration: underline;">&gt; 400k +</span></p>\r\n<p><br />Hurry before the Fed meets again. You owe it to yourself, and your family, to see <br />how these programs may help.</p>\r\n<p>Good Luck!<br />The LRS Team</p>', NULL, '2016-10-11 14:49:57', '2016-11-11 05:27:41'),
(215, 12, 'RF-44A', '<p>Hi %%First Name%%, <br /><br />I&rsquo;m sure you heard that the Fed recently raised rates for the first time in over a <br />decade. But, you may not know that rates are STILL near historic lows! <br /><br />Now is the time to Re--finance before continue to go up, up, up! Please take 60 <br />seconds to check how you may be able to REDUCE your monthly mortgage<br />payment even if you owe more than your home is worth. <br /><br />We only need a few pieces of information to complete your inquiry and get you <br />connected to top programs.</p>\r\n<p>Tap your age to get started:</p>\r\n<p><br /><span style="text-decoration: underline;">&gt; 18-25</span><br /><span style="text-decoration: underline;">&gt; 26-35</span><br /><span style="text-decoration: underline;">&gt; 36-45</span><br /><span style="text-decoration: underline;">&gt; 46-55</span><br /><span style="text-decoration: underline;">&gt; 56-65</span><br /><span style="text-decoration: underline;">&gt; Over 65</span></p>\r\n<p>&nbsp;</p>\r\n<p>Click here to get your FR---EE quote now!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Low Rate Shop</p>', NULL, '2016-10-11 14:51:15', '2016-11-11 05:34:52'),
(216, 23, 'OT-1', '<p><strong>Stop Paying Penalties! Erase Your Tax Debt!<br /></strong><br />Optima Tax Relief Can Help You:<br />*Reduce Tax Debt<br />*Stop Tax Levies and Liens<br />*End Wage Garnishments<br />*Negotiate an Affordable Monthly Payment<br /><br /><span style="text-decoration: underline;">Time is Limited - Go Here Now!</span><br /><br /><br />There is no cost to begin with - Why not take a few minutes of your time why not find <br />out more now? It&rsquo;s easier than you think and it very well could dramatically reduce your <br />bills.</p>\r\n<p>&nbsp;</p>', NULL, '2016-10-11 14:53:04', '2016-11-11 05:39:08'),
