(248, 24, 'VA-1', '<p>Find out in mere minutes if you are eligible for a VA Home Loan.<br /><br />If you are an active military service member or previously have <br />served in the armed forces, you may be eligible for a VA Home Loan!</p>\r\n<p><span style="text-decoration: underline;"><br />A Direct Deposit Could Be Yours&nbsp; Go Here Now!</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-12 14:50:59', '2016-10-12 14:50:59'),
(249, 25, 'CP-1', '<p>URGENT WARNING:<br /><br />Our elected officials just triggered an unstoppable economic crisis<br />&nbsp;<br />That&rsquo;s why I\'ve urged all of our subscribers to <span style="text-decoration: underline;">watch this controversial video</span>,<br />and I encourage you to do the same.</p>\r\n<p><br />Now, I confess...<br />&nbsp;<br />Many on Wall Street dismissed my bold claims at first.<br />&nbsp;<br />But after seeing the evidence...<br />&nbsp;<br />-&nbsp; 7 indisputable charts (the 5th one hits Baby Boomers hard)<br />-&nbsp; The hidden story behind a $5 bill &hellip; and why it has been shackled<br />-&nbsp; A prophetic warning woven into a forgotten manuscript from our Founding Fathers.<br />They warned an economic &ldquo;curse&rdquo; would unfold if our elected official committed<br />this one crime (and unfortunately, this one crime was just executed).<br />&nbsp;<br />No one can deny that an economic collapse looms.<br />&nbsp;<br />If you have any money in stocks, own a home, or have a savings account,<br />it&rsquo;s critical you watch it now while it still costs nothing.<br />&nbsp;<br /><span style="text-decoration: underline;">Simply click here to start your quick video.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-10-12 14:53:02', '2016-10-12 14:53:02'),
(250, 24, 'CP-2', '<p>URGENT WARNING:<br /><br />If you follow the market, you know it\'s been a bumpy ride for investors the last few weeks.<br />But what you might not know is that I predicted the markets recent nosedive several months ago.</p>\r\n<p>The scary thing is, I also predict it\'s about to get a lot worse...<br /><br /><span style="text-decoration: underline;">According to our research</span>, five charts prove that the stock market is on the cusp of crashing by 50%,<br />maybe more. (The last time these charts aligned was right before the 1929 stock market crash.)<br />&nbsp;<br />To be clear, in over 30 years as an economist, I\'ve never been more certain about a prediction,<br />and I urge you to heed my warning.</p>\r\n<p>In our latest video...<br />We reveal news of a landmark development that we are convinced will trigger the greatest economic<br />collapse we have ever seen.<br /><br /><br />If you have a 401K plan, IRA or any money in stocks,<br />it\'s critical you <span style="text-decoration: underline;">take a look at these 5 charts immediately.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-10-12 14:54:33', '2016-10-12 14:54:33'),
(251, 26, 'ARQ-1', '<p>Re:<br />Case Number &nbsp;&nbsp; - &nbsp;&nbsp; ACC-091783</p>\r\n<p><br />Your account history was recently reviewed and it has been determined<br />that you meet the eligibility requirements for the American Rate Quotes.<br /><br /><span style="text-decoration: underline;">Please take a few minutes of your time and apply here now.</span><br /><br />Traditional requirements have recently been waived and it is now easier<br />for homeowners to qualify for lower rates and more affordable loans.<br /><br />Take advantage of this while you still can.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Kind Regards,<br /><br />Jason Prescott<br />HCA</p>', NULL, '2016-10-12 14:56:14', '2016-10-12 14:56:14'),
(252, 3, 'CTS-1', '<p>Good morning ##first_name##<br />&nbsp;<br />Hope you have a great day today and an even greater week.<br />&nbsp;<br /><br />Just a quick reminder:<br />&nbsp;<br />You may still be eligible to receive money for school.<br />&nbsp;<br />The amount available is $5,815<br />&nbsp;<br />And... if you\'re eligible, the funds can be directly deposited into your bank<br />account or you can receive the full amount on a personalized check.<br />&nbsp;<br />Because these are granted funds, you do not have to pay the money back.<br />&nbsp;<br />It is easy and quick to find out if you\'re eligible.<br /><br />Why not find out what schools you can potentially attend with aid?<br />&nbsp;<br /><br /><span style="text-decoration: underline;">Stop Being a Statistic - Go Here Now!</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-10-19 03:31:28', '2016-10-19 03:31:28'),
(253, 5, 'CCU5', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">Hi [[firstname]],</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">We have some good news for you! &nbsp;You now may be eligible to apply to </span><span style="font-size: 11pt; font-family: Arial, sans-serif;">renowned <br />Colorado Christian University. &nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><u><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: blue;">Confirm Your Eligibility Now!</span></u></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">This is a quick screening process and will only take a little bit of your <br />time. Assistance to help cover your schooling expenses may also be available. Take <br />advantage of this while you still can.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Best of luck,</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 14.6667px;">(name)</span></p>', NULL, '2016-10-21 06:32:31', '2016-10-21 06:32:31'),
(254, 5, 'CCU6', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">Hi [[firstname]],</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Colorado Christian</span><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;"> University is now accepting applicants and according to our <br />records you may meet the eligibility requirements for acceptance as well as aid.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><u><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: blue;">Act now to confirm your eligibility.</span></u></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Aid is allocated on a case by basis and would not have to be paid back. Act now <br />while this is still available to you.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Regards,</span></p>\r\n<p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 14.6667px;">(name)</span></p>', NULL, '2016-10-21 06:33:12', '2016-10-21 06:33:12'),
(255, 5, 'CCU7', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">Hi [[firstname]],</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Congratulations - You may now apply to prestigious Colorado Christian</span><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;"> University. You are <br />also potentially able to apply for aid to help with schooling.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><u><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: blue;">Act Now! &nbsp;Take advantage of this opportunity while you still can.</span></u></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Aid is allocated on a case by case and first come basis and would not have to be paid <br />back. &nbsp;Act now while this is still available to you.</span></p>\r\n<p class="MsoNormal"><span style="font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Regards,</span></p>\r\n<p class="MsoNormal"><span><span style="font-family: Arial, sans-serif;"><span style="font-size: 14.6667px;">(name)</span></span></span></p>', NULL, '2016-10-21 06:34:01', '2016-10-21 06:34:01'),
(256, 5, 'CCU8', '<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">Hi [[firstname]],</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: #262626;">We have some good news for you. &nbsp;You may now be able to apply to renowned Colorado <br />Christian University. &nbsp;&nbsp;You may also apply for assistance with schooling.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><u><span style="font-size: 11.0pt; font-family: \'Arial\',sans-serif; color: blue;">This Is a Limited Time Opportunity - Take Advantage of It Now!</span></u></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Assistance is given out on a first come first serve basis and would not have to be <br />repaid. &nbsp;Take advantage of this opportunity while you still can.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: Arial, sans-serif;">Sincerely,</span></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 11.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';"><br /> </span><span style="font-size: 11pt; font-family: Arial, sans-serif;">(name)</span></p>', NULL, '2016-10-21 06:36:04', '2016-10-21 06:36:04'),
(257, 1, 'UM-1', '<p>Hi [[firstname]],<br /><br />Have you ever thought about a career in healthcare?&nbsp; If so look no further. <br /><br />As a UMA student, you get personalized attention from the very beginning, throughout training, and after you graduate.<br />Here are just a few of Ultimate Student Services that are included in our competitively priced tuition:<br /><br />●&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;One-On-One Tutoring<br />●&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Certification Preparation<br />●&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;24/7 Technical Support<br />●&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Job Interview Coaching<br />●&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Job Search Assistance<br />●&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; Online training<br /><br /><br />Why not take a few minutes to find out whether or not this is the right choice for you?<br /><br /><strong><span style="text-decoration: underline;">Click here now to discover how we can help you succeed.</span></strong><br /><br />We are here to help!</p>\r\n<p>&nbsp;</p>\r\n<p>Sincerely,<br /><br />Alex<br /><br /></p>', NULL, '2016-11-07 13:47:03', '2016-11-11 03:48:26'),
(258, 7, 'LB7A', '<p>Hi [[firstname]],<br /><br />Since 1971, Liberty\'s mission as a university has been to provide a world-class<br />educational experience with a solid Christian foundation to equip men and<br />women with the values, knowledge, and skills essential for success in every<br />aspect of life.<br /><br />Currently, Liberty has some of the highest retention and graduation rates of<br />any leading online university.<br /><br />Good news!&nbsp; According to our records, you are eligible to apply to attend<br />Liberty University. Take advantage of this opportunity now!<br /><br />Financial aid may also be available to help with schooling.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>A rewarding future awaits you -- act now!</strong></span></p>', NULL, '2016-11-07 13:57:18', '2016-11-07 13:57:18'),
(259, 7, 'LB8A', '<p>Hi [[firstname]],<br /><br />Liberty University is consistently rated as one of the top distance educators in<br />the nation, and known for its affordability and exceptional student support.<br />It maintains high student satisfaction as well as impressive retention and<br />graduation rates.<br /><br />Great news!&nbsp; According to our records, you are eligible to apply to attend<br />Liberty University. <span style="text-decoration: underline;"><strong>Take advantage of this opportunity now -- Click Here!</strong></span><br /><br />Financial aid may also be available to help with schooling.&nbsp; Act now to get<br />started on your education!<br /><br />Currently, Liberty University has some of the highest retention and graduation<br />rates of any leading online university. A rewarding future awaits you!</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-11-07 14:23:27', '2016-11-07 14:23:27'),
(260, 7, 'LB9A', '<p>Hi [[firstname]],<br /><br />Liberty University offers more than 500 degrees and certificates online and on campus<br />in areas the market demands most, including business, counseling, criminal justice,<br />education, nursing and psychology to name a few.<br /><br />Great news!&nbsp; According to our records, you are eligible to apply to attend Liberty<br />University.&nbsp;&nbsp; <span style="text-decoration: underline;"><strong>Take advantage of this opportunity now -- Click here!</strong></span><br /><br />Financial aid may also be available to help with schooling.<br />Act now to get started on your education!<br /><br />Liberty University\'s tuition rates are among the lowest of universities offering online<br />programs, and it is consistently rated as one of the top distance educators in the nation.</p>\r\n<p>&nbsp;</p>\r\n<p>Respectfully,</p>\r\n<p>Alex</p>', NULL, '2016-11-07 14:27:21', '2016-11-07 14:27:21'),
(261, 7, 'LB7A13', '<p>Hi [[firstname]],<br /><br />Since 1971, Liberty\'s mission as a university has been to provide a world-class<br />educational experience with a solid Christian foundation to equip men and<br />women with the values, knowledge, and skills essential for success in every<br />aspect of life.<br /><br />Currently, Liberty has some of the highest retention and graduation rates of<br />any leading online university.<br /><br />Good news! According to our records, you are eligible to apply to attend Liberty<br />University.&nbsp;&nbsp;&nbsp; <span style="text-decoration: underline;"><strong>Take advantage of this opportunity now -- Click here!</strong></span><br /><br />Financial aid may also be available to help with schooling.<br />A rewarding future awaits you -- act now!</p>', NULL, '2016-11-07 14:28:39', '2016-11-07 14:28:39'),
(262, 7, 'LB8A13', '<p>Hi [[firstname]],<br /><br />Liberty University is consistently rated as one of the top distance educators in<br />the nation, and known for its affordability and exceptional student support. <br /><br />Great news! According to our records, you are eligible to apply to attend Liberty<br />University.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="text-decoration: underline;"><strong>Take advantage of this opportunity now -- Click here!</strong></span><br /><br />Financial aid may also be available to help with schooling.&nbsp; Act now to get started<br />on your education!</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Alex</p>', NULL, '2016-11-07 14:29:36', '2016-11-07 14:29:36'),
(263, 7, 'LB9A13', '<p>Hi [[firstname]],<br /><br />Liberty University offers more than 500 degrees and certificates online and on<br />campus in areas the market demands most, including business, counseling,<br />criminal justice, education, nursing, and psychology to name a few.<br /><br />Great news! According to our records, you are eligible to apply to attend Liberty<br />University. &nbsp; &nbsp; <span style="text-decoration: underline;"><strong>Take advantage of this opportunity now -- Click here!</strong></span><br /><br />Financial aid may also be available to help with schooling.&nbsp; Act now to get started<br />on your education!<br /><br />Liberty University\'s tuition rates are among the lowest of universities offering<br />online programs, and it is consistently rated as one of the top distance educators<br />in the nation.</p>', NULL, '2016-11-07 14:30:49', '2016-11-07 14:30:49'),
(264, 1, 'OL-1', '<p>Hi [[firstname],<br />&nbsp;<br />Are you short on cash?&nbsp; (Yes, I like to get straight to the point). If so, you need to read this.<br />&nbsp;<br />At 100Lenders, personal loans of $1,500 to $35k are available to be direct deposited to your bank as<br />soon as the next business day, if qualified.&nbsp;&nbsp; Bad or poor credit?&nbsp; Don&rsquo;t worry, as all scores are<br />considered. Conditions vary by lender.<br />&nbsp;<br /><span style="text-decoration: underline;"><strong>Click Here Now</strong></span><br />&nbsp;<br />In a few minutes or less, you could potentially solve your money issues and be on your way to<br />getting the funds you need to ease your mind.&nbsp;&nbsp; 100Lenders has helped over 300,000 people apply for<br />a loan - why not you?</p>\r\n<p><br />Sincerely,<br />&nbsp;<br />Alex</p>', NULL, '2016-11-09 17:41:42', '2016-11-09 17:41:42'),
(265, 27, 'LR-1', '<p>Date: [[Todaysdate]]<br />&nbsp;<br />This is an important update regarding 2016 mortgage refinance applications.<br />Rates have just dropped dramatically and if you qualify there is still time to lock them in.<br />&nbsp;<br />Please click here to calculate and finalize your lower interest rates for 2016.<br />&nbsp;<br />Important Mortgage Information:<br />&nbsp;<br />The mortgage industry allows homeowners and businesses the option to refinance their<br />properties by consolidating other debts to get better interest rates. With our service you can get<br />multiple offers from top lenders in your state to lock in the lowest rates possible.<br /><span style="text-decoration: underline;"><strong>Click Here</strong></span> to learn more about how to ensure you get the lowest rates on your mortgage.</p>\r\n<p><br />Sincerely,<br />&nbsp;<br />Alex</p>', NULL, '2016-11-09 17:48:19', '2016-11-09 18:05:06'),
(266, 27, 'LR-2', '<p>Hello [[Fname]], I hope you are doing well!<br />&nbsp;<br />I\'m just leaving the office but wanted to share something with you that just<br />came across my desk...<br />&nbsp;<br />The President just released a program that could instantly reduce your<br />mortgage!<br />&nbsp;<br /><span style="text-decoration: underline;"><strong>Check it out here</strong></span><br />&nbsp;<br />Let me know if this works for you!<br />&nbsp;<br />Thanks!</p>', NULL, '2016-11-09 17:49:04', '2016-11-09 18:05:31'),
(267, 27, 'LR-3', '<p>Hey %%firstname%%,<br />&nbsp;<br />Just a quick heads up...<br />&nbsp;<br />The President just announced his HARP 2.0 mortgage program and it\'s saving<br />homeowners everywhere on their mortgage.<br />&nbsp;<br />I emailed you today because our records indicate that you may qualify...<br />&nbsp;<br /><span style="text-decoration: underline;"><strong>Confirm your qualification here</strong></span><br />&nbsp;<br />This has the potential to make an enormous difference in your monthly bill.<br />Take advantage of this while you still can.</p>\r\n<p><br />Best Wishes,</p>\r\n<p>Alex</p>', NULL, '2016-11-09 17:51:18', '2016-11-09 18:05:21'),
(268, 27, 'LR-4', '<p>Hi %%First Name%%,<br />&nbsp;<br />I know that you&rsquo;ve heard it before, but this may really be your last chance to<br />Refinance before rates go way, way up!<br />&nbsp;<br />With the election now completed rates are going to be changing dramatically<br />and now is probably your best chance to lock in existing near record low rates..<br />&nbsp;<br />So, if you haven&rsquo;t checked on your loan, this is truly your last chance to take<br />advantage of these historically low rates.<br />&nbsp;<br />Check how much you can save by tapping on your Current Loan Balance:<br />&nbsp;<br /><span style="text-decoration: underline;"><strong>&gt; Under 100k</strong></span><br /><span style="text-decoration: underline;"><strong>&gt; 100k - 250k</strong></span><br /><span style="text-decoration: underline;"><strong>&gt; 250k - 400k</strong></span><br /><span style="text-decoration: underline;"><strong>&gt; 400k +</strong></span><br />&nbsp;<br />Hurry before the Fed meets again. You owe it to yourself, and your family, to see<br />how these programs may help</p>\r\n<p><br />Good Luck!</p>\r\n<p>Alex</p>', NULL, '2016-11-09 17:52:08', '2016-11-09 18:05:16'),
(269, 28, 'SL-1', '<p>Flexible, Affordable, ONLINE<br /><br />Established in 1889 by the Order of Saint Benedict of Florida, the Saint Leo<br />university seeks balanced growth in mind, body and spirit for all members of our<br />community.<br /><br />Saint Leo has grown from a peaceful campus in the rolling hills of Central Florida to<br />an institution of international consequence&mdash;ranked one of the best regional<br />universities in the South by U.S. News &amp; World Report.<br /><br />Our determination to make higher education more accessible to all has made Saint<br />Leo a world leader in redefining the 21st century university.<br /><br /><br /><span style="text-decoration: underline;"><strong>Click here now to discover how Saint Leo can work for you!</strong></span><br /><br /><br />Kind Regards,<br /><br />Alex</p>', NULL, '2016-11-10 14:12:02', '2016-11-10 14:12:02'),
(270, 28, 'SL-2', '<p>Hi [[firstname]],<br /><br />At Saint Leo, we offer online degree programs, open enrollment, affordable tuition<br />rates, and a flexible learning style designed to accommodate your life.<br /><br />Saint Leo University offers a practical, effective model for life and leadership in a<br />challenging world; a model based on a steadfast moral consciousness that<br />recognizes the dignity, value, and gifts of all people.<br /><br />Choose from associate, bachelor, master, doctorate or certificate programs in a<br />variety of fields including business administration, human resources, criminal justice<br />administration, accounting and more.<br /><br />Why not take a few minutes to discover how Saint Leo can work for you? &nbsp;<br /><br /><br /><span style="text-decoration: underline;"><strong>Click Here Now</strong></span><br /><br /><br />Sincerely,<br /><br />Alex</p>', NULL, '2016-11-10 14:12:48', '2016-11-10 14:12:48'),
(271, 28, 'SL-3', '<p>Hi [[firstname]],<br /><br />I wanted to let you know about an educational opportunity that I thought that you<br />might be interested in.<br /><br />Saint Leo is a traditional but cutting edge university that seeks balanced growth in<br />mind, body and spirit for all members of our community.<br /><br />It has consistently been ranked amongst the top online colleges in the nation for four<br />years in a row. Saint Leo is also one of the nation&rsquo;s 10 leading providers of higher<br />education to the U.S. military.<br /><br />As of this morning you were able to take advantage of their open enrollment,<br />affordable tuition rates, flexible learning style which designed to accommodate your<br />life.<br /><br /><span style="text-decoration: underline;"><strong>Click Here Now to Find out How Saint Leo&rsquo;s Can Work For You</strong></span><br /><br />In mere minutes you can discover what programs are available that will fit your busy<br />life and schedule.<br /><br /><br />All the best,<br /><br />Alex</p>', NULL, '2016-11-10 14:13:39', '2016-11-10 14:13:39');
